INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES
(1,	4,	'2016-01-13 20:52:11',	'Have questions? Magento has big answers at Imagine Commerce.',	'Big news, bigger experts, and an even bigger ecosystem. Will you be at Imagine Commerce? Join us. ',	'http://imagine.magento.com',	1,	0),
(2,	1,	'2016-01-20 20:17:09',	'Important: Install Magento Community Edition 2.0.1 for Security & Functional Updates – 1/20/2016',	'Today, we are releasing Magento Community Edition 2.0.1 to improve the security and functionality of Magento 2.0 sites. There are no confirmed attacks related to the security issues, but certain vulnerabilities can potentially be exploited to access customer information or take over administrator sessions. Community Edition 2.0.1 also includes USPS API updates and support for PHP7.0.2, which enables dramatic performance improvements and other benefits. You can download the release from the Community Edition Download Page or by using Composer. Learn more at https://magento.com/security/patches/magento-201-security-update. \n',	'https://magento.com/security/patches/magento-201-security-update',	1,	0),
(3,	1,	'2016-01-28 22:08:45',	'Important: Magento Community Edition 2.0.2 Addresses Upgrade Issues – January 28, 2016',	'Newly released Magento Community Edition 2.0.2 resolves issues encountered by some users when upgrading Magento Community Edition 2.0.0 and 2.0.1. The issues occur with products that were installed from a compressed archive (.tar.gz, .zip, and .bz2); merchants who used other installation options are not affected. More information is available in the Technical Bulletin at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_201-upgrade.html. ',	'http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_201-upgrade.html',	1,	0),
(4,	4,	'2017-07-27 21:13:00',	'Listing your products in marketplaces like Amazon? We want your feedback!',	'If you sell your products in any marketplace/s today and/or are considering it in the future, we invite you to take our short survey. Your feedback will help us to determine the overall interest and need for integration with marketplace and fulfillment services from companies like Amazon.\n\nThank you in advance.\n\nThe Magento Strategy team',	'https://www.surveymonkey.com/r/3F5MT75',	0,	0),
(5,	4,	'2017-08-09 17:30:50',	'Upgrade to Magento Open Source 2.1.8 for Over 90 Enhancements – 8/8/2017',	'Magento Open Source (formerly Community Edition) 2.1.8 features over 90 improvements, including cache tuning for better performance, mass action performance optimizations, and faster deployments for multi-language sites. \n\nReview the release notes for more information: http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',	'http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',	0,	0),
(6,	4,	'2017-08-18 14:41:03',	'Join the Magento BI Essentials Webinar: Make Data Easy ',	'Join our webinar on Tuesday, August 22nd and learn about why merchants like you are choosing Magento BI  Essentials to make it easier to harness the power of your data. \n\nBob Moore, Head of Magento BI, will be discussing the value of the reporting and dashboards that comes out-of-the-box with Essentials and the insights you can gain from them. \n\nRegister today. \n\nhttps://magento.com/resources/magento-bi-essentials-making-data-easy?lsdet=MBI-Webinar-RSS\n',	'https://magento.com/resources/magento-bi-essentials-making-data-easy?lsdet=MBI-Webinar-RSS',	0,	0);
