INSERT INTO `catalog_product_entity_text` (`value_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(12,	72,	0,	2,	'Organic Cotton Baby Clothing that is easy to wear, mix and match the classic styles to create your own easy to wear wardrobe for your baby.'),
(13,	82,	0,	2,	'Organic Cotton Baby Clothing that is easy to wear, mix and match the classic styles to create your own easy to wear wardrobe for your baby.'),
(14,	100,	0,	2,	NULL),
(15,	73,	0,	2,	'Because we all live in the time of total consuming of uncountable goods and services, and this has become the main reason for the rapid growth of a so-called culture of consumption in our society.'),
(17,	72,	0,	3,	'The brightly colored Baby First Plant Puzzle is a great first puzzle for tiny hands.<br /><br /><div id=\"shop_productdescription\">	A fun 3D shaped puzzle showing how various plants grow.</div>\r\n'),
(18,	82,	0,	3,	'ESPRIT Men\'s Long Sleeve Jacket'),
(19,	100,	0,	3,	NULL),
(20,	73,	0,	3,	'Our employees put in great efforts to make this commodity. Our good was made up by best experts with the help of most advanced technologies, and it gives us right to consider this product to be a premium one. '),
(23,	72,	0,	4,	'Dimples are proud to bring you nappies made by TotsBots, award winners for reusable nappies.<br /><br />- ActivFlex technology - superior fit, comfort, and containment<br />- Ultra absorbent microfibre core holds twice as much liquid as cotton<br />- Super slim - less bulk than our standard nappies!<br />- Unbelievably soft and comfortable<br />- Optimum absorbency and dries super-fast\r\n'),
(24,	82,	0,	4,	'Fashion Womens Boyfriend Jeans Free Suspenders Light Blue Denim Pants'),
(25,	100,	0,	4,	NULL),
(26,	73,	0,	4,	'We assure you it is really important, it shows that our good has such capacity as flexibility. And it is good for you because as we all know people change their claims with the course of time, and our good will be actual for a long time.'),
(27,	72,	0,	5,	'Made from 50% Merino Wool and 50% cotton. Two of natures most breatheable fibres blended together to create one all climate fabric. Your little one will benefit from the temperature regulating properties of Merino wool and the well thought out desgin of the pyjama top. The cut of the neck line and envelope shoulders enable no-fuss dressing of your little one and result in a comfortable night\'s sleep.<br /><br />Available in Navy, Rasberry, Beige and Teal Marl.\r\n'),
(28,	82,	0,	5,	'Jack and Jones Men\'s JJORCALL Short Parka Coat'),
(29,	100,	0,	5,	NULL),
(30,	73,	0,	5,	'Obviously there is nothing wrong about it because fashion satisfies our willingness to be attractive. And also fashion is the detector of prosperity and social rank. So, our natural desire to wear fashionable clothes has many reasons such as historical, social and others. Therefore being fashionable costs a lot of money.'),
(119,	72,	0,	22,	'Fashion has always been so temporary and uncertain. You can’t keep up with it.  This social phenomenon is very whimsical, thus we as the consumers always try to stay in touch with all the latest fashion tendencies. Obviously there is nothing wrong about it because fashion satisfies our willingness to be attractive. And also fashion is the detector of prosperity and social rank. So, our natural desire to wear fashionable clothes has many reasons such as historical, social and others. Therefore being fashionable costs a lot of money. But nowadays fashion is not such unavailable as it was a couple of centuries ago. We are lucky to have an opportunity to buy qualitative, fashionable and affordable clothes. \r\nSo, with the great pleasure we are offering you our goods, and we are sure that only our choices of garments will suit you best. Our product is universal because it suits different customers with different demands. We assure you it is really important, it shows that our good has such capacity as flexibility. And it is good for you because as we all know people change their claims with the course of time, and our good will be actual for a long time. The main reason of buying our clothes is the unique combination of fair price, extraordinary style and perfect quality.  Here you can find garments of all sizes, colors, styles and fabrics. \r\nIt will suit you best of all. Because we all live in the time of total consuming of uncountable goods and services, and this has become the main reason for the rapid growth of a so-called culture of consumption in our society. So, this circumstance forced all leading successful companies to explore all needs and wishes of different groups of potential clients very deeply. And that is why we are offering you the result of great market and technological research – our magnificent product. Our employees put in great efforts to make this commodity. Our good was made up by best experts with the help of most advanced technologies, and it gives us right to consider this product to be a premium one.'),
