(10,	'Footer column content 4',	'footer_col_4',	'<div class=\"footer-col\">\r\n	<h4>Stay In Touch</h4>\r\n	<div class=\"footer-col-content footer-contacts\">\r\n		<div class=\"newsletter-text\">\r\n			<span class=\"newsletter-text--txt\">\r\n				Get the latest news, updates, and special deals from Dimples - sign up for our monthly newsletter.\r\n			</span>\r\n		</div>\r\n		{{block class=\"Magento\\Newsletter\\Block\\Subscribe\" name=\"dimples\" template=\"Magento_Newsletter::subscribe.phtml\" area=\"frontend\"}}\r\n	</div>\r\n  \r\n<!--  <div class=\"footer-col-content footer-contacts\">\r\n    	<address>My Company Glasgow D04 89GR</address>\r\n    	<span class=\"foooter-contacts--tel\">Tel: <a href=\"tel:+6494461709\">800-2345-6789</a></span>        \r\n        <a href=\"mailto:info@demolink.org\" class=\"footer-contacts--mail\">info@demolink.org</a>\r\n        <span>7 Days a week from 9:00 am to 7:00 pm</span>\r\n    </div> -->\r\n\r\n	<div class=\"social-icons-footer\">\r\n		<a href=\"#\" title=\"Google Plus\" class=\"social-googlePlus\"></a>\r\n		<a href=\"https://www.facebook.com/DimplesBabywear/\" title=\"Facebook\" class=\"social-facebook\"></a>\r\n		<a href=\"https://www.instagram.com/dimplesbabywear/\" title=\"Instagram\" class=\"social-insta\"></a>\r\n	</div>\r\n\r\n\r\n</div>',	'2016-01-27 13:55:13',	'2017-08-21 11:12:26',	1),
(11,	'Slider',	'slider',	'<div class=\"slider_wrapper custom-slider-style\">\r\n    <div class=\"camera_wrap\" id=\"camera_wrap\">\r\n        <div data-src=\"{{view url=\'images/camera/slides/slide1.jpg\'}}\">\r\n            <div class=\"camera_caption fadeIn\">\r\n                <div class=\"camera_caption_txt\">\r\n					<span class=\"camera_caption_txt--style-9\">Lorem ipsum dolor sit </span>\r\n					<span class=\"camera_caption_txt--style-9\">amet consectetuer </span>\r\n					<span class=\"camera_caption_txt--style-9\">adipiscing elit</span>\r\n                    <a href=\"{{store url=\'men.html\'}}\" class=\"camera_caption_txt--btn only-txt\">Shop now</a>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        \r\n        <div data-src=\"{{view url=\'images/camera/slides/slide1.jpg\'}}\">\r\n            <div class=\"camera_caption fadeIn\">\r\n                <div class=\"camera_caption_txt\">\r\n					<span class=\"camera_caption_txt--style-9\">Lorem ipsum dolor sit </span>\r\n					<span class=\"camera_caption_txt--style-9\">amet consectetuer </span>\r\n					<span class=\"camera_caption_txt--style-9\">adipiscing elit</span>\r\n                    <a href=\"{{store url=\'men.html\'}}\" class=\"camera_caption_txt--btn only-txt\">Shop now</a>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>',	'2016-01-28 07:04:17',	'2017-07-28 09:56:12',	1),
(12,	'Showcases',	'showcases',	'<div class=\"showcases\">\r\n	<div class=\"container\">\r\n		<div class=\"designTag\">\r\n			<span> Natural materials, gorgeous designs, made in <strong>New Zealand </strong></span>\r\n		</div>\r\n		<div class=\"category-info\">\r\n			<h1>Welcome Heading Goes Here</h1>\r\n			<p>Comfortable, practical, beautiful…there’s a reason Dimples is a classic New Zealand babywear brand. Originally designed by a mother for her own babies, our clothing and accessories are still made and hand-embroidered here in New Zealand. We’re committed to using only the finest materials – including pure cotton and soft New Zealand merino wool – so our clothes and blankets are gentle, warm and wearable for your precious little ones.  </p>\r\n		</div>\r\n	</div>\r\n	<div class=\"row spl-row\">\r\n		<div class=\"col-md-6 col-xs-12\">\r\n			<div class=\"row\">\r\n				<div class=\"col-xs-6\">\r\n					<img src=\"{{view url=\'images/media/showcase-1.jpg\'}}\" alt=\"showcases-img\" class=\"img-responsive\" data-rjs=\"3\">\r\n					<h1 class=\"show-cat-title\">Clothing</h1>\r\n					<a href=\"{{store url=\'clothing.html\'}}\" class=\"showcase-btn\">Shop Now</a>\r\n				</div>\r\n				<div class=\"col-xs-6\">\r\n					<div class=\"short-product-box m-b-16\">\r\n						<img src=\"{{view url=\'images/media/showcase-2.jpg\'}}\" alt=\"showcases-img\" class=\"img-responsive\">\r\n						<h1 class=\"show-cat-title\">Sleep</h1>\r\n						<a href=\"{{store url=\'sleep.html\'}}\" class=\"showcase-btn\">Shop Now</a>\r\n					</div>\r\n					<div class=\"short-product-box\">\r\n						<img src=\"{{view url=\'images/media/showcase-3.jpg\'}}\" alt=\"showcases-img\" class=\"img-responsive\">\r\n						<h1 class=\"show-cat-title\">Out & About</h1>\r\n						<a href=\"{{store url=\'outabout.html\'}}\" class=\"showcase-btn\">Shop Now</a>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n		<div class=\"col-md-6 col-xs-12\">\r\n			<div class=\"row\">\r\n				<div class=\"col-xs-6\">\r\n					<img src=\"{{view url=\'images/media/showcase-4.jpg\'}}\" alt=\"showcases-img\" class=\"img-responsive\">\r\n					<h1 class=\"show-cat-title\">Furniture</h1>\r\n					<a href=\"{{store url=\'furniture.html\'}}\" class=\"showcase-btn\">Shop Now</a>\r\n				</div>\r\n				<div class=\"col-xs-6\">\r\n					<img src=\"{{view url=\'images/media/showcase-5.jpg\'}}\" alt=\"showcases-img\" class=\"img-responsive\">\r\n					<h1 class=\"show-cat-title\">Gifts & Toys</h1>\r\n					<a href=\"{{store url=\'giftstoys.html\'}}\" class=\"showcase-btn\">Shop Now</a>\r\n				</div>\r\n			</div>\r\n			<div class=\"full-product-box m-t-16\">\r\n				<img src=\"{{view url=\'images/media/showcase-6.jpg\'}}\" alt=\"showcases-img\" class=\"img-responsive\">\r\n				<h1 class=\"show-cat-title\">New Season</h1>\r\n				<a href=\"{{store url=\'men.html\'}}\" class=\"showcase-btn\">Shop Now</a>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>',	'2016-01-29 09:24:49',	'2017-08-23 12:45:36',	1),
(13,	'Block 1',	'block-1',	'<div class=\"block-1\">\r\n	<div class=\"container\">\r\n		<div class=\"product-gallery-desc\">\r\n			<p>\r\n				Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl\r\n			</p>\r\n			<div class=\"center-links\">\r\n				<a href=\"#\">Jenny Jones</a>\r\n				<a href=\"#\">Auckland</a>\r\n			</div>\r\n			<div>\r\n				<a class=\"bordered-btn\" href=\"#\">More</a>\r\n			</div>\r\n		</div>\r\n	</div>\r\n	\r\n	<h1 class=\"sectionHeading\">Helpful Hints</h1>\r\n	<section class=\"help-hints\">\r\n		<div class=\"container\">\r\n			<div class=\"row\">\r\n				<div class=\"col-md-3 col-xs-6 newBorn hint-item\">\r\n					<span class=\"hint-labels\">Newborn Checklist</span>\r\n				</div>\r\n				<div class=\"col-md-3 col-xs-6 sleepHelp hint-item\">\r\n					<span class=\"hint-labels\">Sleep Help</span>\r\n				</div>\r\n				<div class=\"col-md-3 col-xs-6 sizeGuide hint-item\">\r\n					<span class=\"hint-labels\">Size Guide</span>\r\n				</div>\r\n				<div class=\"col-md-3 col-xs-6 instVideo hint-item\">\r\n					<span class=\"hint-labels\"><a href=\"/instructional-videos\">instructional videos</a></span>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</section>\r\n	\r\n	\r\n</div>',	'2016-02-01 10:09:40',	'2017-08-08 12:50:16',	1),
(14,	'Additional info',	'add-info',	'<div class=\"add-info custom-info-section\">\r\n	<div class=\"custom-info-section-title\">\r\n		<div class=\"container\">\r\n			<h1>Heading Goes Here</h1>\r\n		</div>\r\n	</div>\r\n	<ul>\r\n		<li>\r\n			<div class=\"light-ylw-bg\">\r\n				<div class=\"info-img\">\r\n					<img src=\"{{view url=\'images/media/info-1.jpg\'}}\" alt=\"add-info-img\">\r\n				</div>\r\n				<div class=\"add-info--content\">\r\n					<span class=\"add-info--title\">Miraculous Merino </span>\r\n					<span class=\"add-info--text\">Merino is soft, warm, and natural – no wonder parents and babies love it. We source our pure merino wool from a remote South Island station, and process it in New Zealand. \r\n</span>\r\n					<a href=\"{{store url=\'men.html\'}}\" class=\"add-info--link\">more</a>\r\n				</div>\r\n				<div class=\"clearfix\"></div>\r\n			</div>\r\n		</li>\r\n		<li>\r\n			<div class=\"light-blue-bg\">\r\n				<div class=\"info-img\">\r\n					<img src=\"{{view url=\'images/media/info-2.jpg\'}}\" alt=\"add-info-img\">\r\n				</div>\r\n				\r\n				<div class=\"add-info--content\">\r\n					<span class=\"add-info--title\">See the range in real life </span>\r\n					<span class=\"add-info--text\">Visit our store to see and touch our soft, gorgeous babywear and accessories for yourself.</span>\r\n					<a href=\"{{store url=\'women.html\'}}\" class=\"add-info--link\">more</a>\r\n				</div>\r\n				<div class=\"clearfix\"></div>\r\n			</div>\r\n		</li>\r\n		<li>\r\n			<div class=\"light-grey-bg\">\r\n				<div class=\"info-img\">\r\n					<img src=\"{{view url=\'images/media/info-3.jpg\'}}\" alt=\"add-info-img\">\r\n				</div>\r\n				<div class=\"add-info--content\">\r\n					<span class=\"add-info--title\">Gift Giving</span>\r\n					<span class=\"add-info--text\">Our beautiful clothing and accessories make perfect baby shower presents. If you’re not sure what to choose, start here, or buy a gift voucher and let them decide.</span>\r\n					<a href=\"{{store url=\'