(24,	'Contact Us',	'contact-us',	'<p> Dimples is all about caring for our customers. We want you to have a great experience with us – from website to delivery to receiving and using your beautiful babywear. \r\n</p>\r\n\r\n<p> That’s why we’re always ready to help. If you have a question, you’re concerned about your order, or you just want to give us some feedback, get in touch today. \r\n</p>\r\n<p> \r\n\r\n<strong> Email:  </strong><a href=\"mailto:info@dimples.co.nz \">info@dimples.co.nz  </a> |  <strong> Call: </strong>  09 523 4161 </p>\r\n<p> Week days <strong> 10am - 5pm </strong> </p> \r\n\r\n\r\n<p> For wholesale<strong> enquiries: 09 360 2000 </strong> </p>\r\n\r\n',	'2017-08-17 11:29:17',	'2017-08-28 08:56:35',	1),
