(9,	'Terms and Conditions',	'1column',	NULL,	NULL,	'terms-and-conditions',	NULL,	'<div class=\"col-sm-3 col-xs-12\">{{widget type=\"Ves\\Megamenu\\Block\\Widget\\Menu\" alias=\"terms-menu-cms\"}}</div>	\r\n<div class=\"col-sm-9 col-xs-12\">	\r\n<dl class=\"custom-page\">\r\n<h1 class=\"display-4 base-heading\">Terms & Conditions</h1>\r\n<dt class=\"heading-2\">Issued by Dimples</dt>\r\n<dd>\r\nThe following Terms and Conditions govern the use of Dimples’ online service, including shopping and participation in promotions. You can access this agreement at any time in the ‘useful information’ section at the bottom of the page.\r\n<br><br>\r\nBy using our website, you accept these terms and conditions in full; if you at any time disagree to these terms and conditions, you must not use this website. If you register or order from our website, you are expressly agreeing to these terms and conditions.\r\n<br><br>\r\n</dd>\r\n    <dt class=\"heading-2\">Dimples by Jane Anne</dt>\r\n    <dd>We are a New Zealand based company. All orders will be shipped and processed from our Head Office in Auckland.</dd>\r\n\r\n    <dt class=\"heading-2\">Pricing</dt>\r\n    <dd>All prices are in New Zealand Dollars ($) and include GST sales tax (15%). All prices are correct at time of publication; however, we have the right to alter prices for any reason at any time.</dd>\r\n\r\n    <dt class=\"heading-2\">Colours</dt>\r\n    <dd>We make every effort to display product colours as accurately as possible on our website. However, colours may seem different depending on your monitor. We cannot guarantee that your monitor’s display of any colours will be accurate.</dd>\r\n\r\n    <dt class=\"heading-2\">Product Information</dt>\r\n    <dd>We make every effort to photograph and describe our products as accurately as possible. <br><br>\r\nThe website is provided for our customers to buy or find out more about our products and services. Some products may only be purchased from our website or instore.<br><br>\r\nWe reserve the right to limit quantities or limit the number of products customers can purchase in a single transaction.\r\n</dd>\r\n\r\n    <dt class=\"heading-2\">Stock Availability</dt>\r\n    <dd>All products displayed on our website are subject to availability on our website or in the physical store. We make every effort to provide accurate stock availability information on our website. <br><br>\r\nWe do not guarantee that if a product is classified as being “in stock” that the stock will be available to purchase online or at our store.\r\n</dd>\r\n\r\n    <dt class=\"heading-2\">Use of this Website</dt>\r\n    <dd>Your right to use this website is personal to you. You may not authorize others to use this website and you are responsible for your own use of this website.<br><br>\r\nOther than connecting to Dimples servers by HTTP requests using a web browser, you may not attempt to gain access to Dimples servers by any means including, without limitation, by using administrator passwords or by masquerading as an administrator while using this website.<br><br>\r\nYou agree not to disrupt, modify or interfere with this website or its associated software, hardware and servers in any way. You agree not to impede or interfere with others\' use of this website. You further agree not to alter or tamper with any information or materials on, or associated with, Dimples and/or this website. \r\n</dd>\r\n</dl>\r\n</div>',	'2017-07-31 06:36:07',	'2017-09-01 12:41:07',	1,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	0),
(10,	'FAQ',	'1column',	NULL,	NULL,	'faq',	NULL,	'<div class=\"col-sm-3\">{{widget type=\"Ves\\Megamenu\\Block\\Widget\\Menu\" alias=\"terms-menu-cms\"}}</div>	\r\n\r\n<div class=\"col-sm-9\">\r\n	<h1 class=\"display-4 base-heading\">FAQ</h1>\r\n<h3>Q.  Does Dimples make sunhats in newborn size?</h3>\r\n\r\n<p>A.  You will find it difficult to find a babywear label that does produce sunhats in newborn size. What we suggest is that you choose from the Dimples Organic Baby ranges as these hats are made for a slightly more snug fit. If you buy size small (head circumference 46.5cm), you can turn the front brim of the hat up whilst still providing sufficient protection from the sun.</p>\r\n\r\n<h3>Q.  Do your garments have \'New Zealand Made\' printed on the labels?</h3>\r\n\r\n<p>A.  Yes, they certainly do have NZ made on the label. We are very proud of the fact that our garments are not only designed but also made in New Zealand.</p>\r\n\r\n<br />\r\n<br />\r\n<br />\r\n</div>',	'2017-07-31 07:09:19',	'2017-09-06 12:23:50',	1,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	0),
(11,	'Washing Guide',	'1column',	NULL,	NULL,	'washing-guide',	NULL,	'<div class=\"col-sm-3\">{{widget type=\"Ves\\Megamenu\\Block\\Widget\\Menu\" alias=\"top-tips-cms-menu\"}}</div>	\r\n\r\n  <div class=\"col-sm-9\">\r\n      <h1 class=\"display-4 base-heading\">Washing Instructions</h1>\r\n      <h3 class=\"third-color fa-2x font-light font-size-24\">Practical and lasting – washing your Dimples clothing</h3>\r\n      <div class=\"washing-instructions globel-right-content\" style=\"margin-top:0\">\r\n        <div class=\"row\">\r\n          <div class=\"col-md-12\">\r\n            <p>We know busy parents don’t have time for fussy hand-washing, so most of our day to day babywear is easy to launder and care for. </p>\r\n            <p>To make sure your Dimples garments look beautiful for as long as possible, follow our simple care instructions. </p>\r\n          </div>\r\n          <div class=\"clearfix\"></div>\r\n          \r\n          \r\n          \r\n          \r\n          <div class=\"col-md-12 rules-and-regulations\">\r\n            <h3 class=\"third-color fa-2x font-light font-size-24\">Dimples Classic Cotton Ranges - 93% Cotton, 7% Elastane</h3>\r\n            <p class=\"secondary-color\">Cold water wash</p>\r\n             <p class=\"secondary-color\">Do Not Soak, Bleach, Tumble Dry or Dry Clean</p>\r\n             <p>Warm iron</p>\r\n             \r\n             <h4 class=\"third-color fa-2x font-light font-size-24\">Classic Cotton Fleece Tracksuits - 100% Cotton</h4>\r\n            <p class=\"secondary-color\">Cold water wash</p>\r\n             <p class=\"secondary-color\">Do Not Soak, Bleach, Tumble Dry or Dry Clean</p>\r\n             <p>Warm iron</p>\r\n             \r\n            <div class=\"topics\">\r\n              <h4 class=\"third-color fa-2x font-light font-size-24\">100% Merino Wool ranges</h4>\r\n              <ul>\r\n                <li><p>Always used an approved liquid wool detergent or other trusted product. We suggest Softly or Lux Flakes to wash Dimples garments. Use the wool wash cycle on your washing machine. </p>\r\n                </li>\r\n                \r\n                <li><p>Do not soak or wash your woollen garments in powdered laundry products as these contain whiteners that act like a bleach. Even \'eco-whiteners\' may still bleach your garment, creating spots and holes.</p></li>\r\n                \r\n                \r\n                <li><p>Use Wondersoap (cake soap) for the removal of stains prior to washing the garment. </p></li>\r\n<li><p>If hand washing woollen garments: gently hand wash in warm water, rinse well, gently wring and dry flat in shade as direct sunlight will cause discolouration.</p>\r\n<li><p>Do not bleach, rub, soak or tumble dry. Cool steam iron. Dry cleanable.</p></li>\r\n               </ul>\r\n            </div>\r\n            \r\n            \r\n            <div class=\"topics\">\r\n              <h4 class=\"third-color fa-2x font-light font-size-24\">Wool cotton – Wonder Fibre and Wool Cotton Blend ranges</h4>\r\n              <p>Always used an approved liquid wool detergent or other trusted wool product. We suggest Softly or Lux Flakes to wash Dimples garments. You can use the wool wash cycle on your washing machine.</p>\r\n              <ul>\r\n              <li><p>Do not soak or wash your woollen garments in powdered laundry products as these contain whiteners that act like a bleach. Even \'eco-whiteners\' may still bleach your garment creating spots and holes!</p></li>\r\n<li><p>Use Wondersoap (cake soap) for the removal of stains prior to washing the garment.</p></li>\r\n<li><p>If hand washing woollen garments - gently hand wash in warm water, rinse well, gentle wring and dry flat in shade as direct sunlight will cause discolouration.</p></li>\r\n<li><p>Do not bleach, rub, soak or tumble dry. Cool steam iron. Dry cleanable.</p></li>\r\n\r\n\r\n               </ul>\r\n            </div>\r\n          \r\n          \r\n          <div class=\"topics\">\r\n          <h4 class=\"third-color fa-2x font-light font-size-24\">Classic Special Occasions Silk – 100% pure Silk </h4>\r\n\r\n<p>Dry-clean only</p>\r\n</div>\r\n <div class=\"topics\">\r\n<h4 class=\"third-color fa-2x font-light font-size-24\">Classic Accessories </h4>\r\n<p>100% Cotton items, 100% Cotton Velour Towelling, 100% Cotton Muslin </p>\r\n</div>\r\n\r\n <div class=\"topics\">\r\n\r\n<h4 class=\"third-color fa-2x font-light font-size-24\">Cold water wash</h4>\r\n<p>Do Not Soak, Bleach, Tumble Dry or Dry Clean</p>\r\n<p>Warm iron</p>\r\n</div>\r\n\r\n <div class=\"topics\">\r\n\r\n<h4 class=\"third-color fa-2x font-light font-size-24\">Classic Dimples Bedding </h4>\r\n<p>100% Cotton Sheets, Cotton Waffle Blanket, Wool Waffle Blanket</p>\r\n<p>Cold water wash</p>\r\n<p>Do Not Soak, Bleach, Tumble Dry or Dry Clean</p>\r\n<p>Warm iron</p>\r\n       </div>   \r\n            \r\n       <div class=\"topics\">      \r\n            <h4 class=\"third-color fa-2x font-light font-size-24\">\r\n            Organic 100% New Zealand Merino Wool Blanket</h4>\r\n\r\n<p>Gentle Hand Wash 30°c </p>\r\n<p>Rinse Well</p>\r\n<p>Gentle Wring</p>\r\n<p>Do Not Bleach, Rub, Soak or Tumble Dry</p>\r\n<p>Dry Flat in Shade</p>\r\n<p>Cool Steam Iron</p>\r\n<p>Dry Cleanable</p>\r\n            \r\n  </div>           \r\n  <div class=\"topics\"> \r\n  <h4 class=\"third-color fa-2x font-light font-size-24\">100% Organic Cotton Ranges</h4>\r\n<p>Machine wash using cold or warm water with powdered or liquid detergent</p>\r\n<p>Use Wondersoap to remove stains prior to washing</p>\r\n<p>Do Not Soak, Bleach, Tumble Dry or Dry Clean</p>\r\n<p>Warm iron</p>\r\n</div>\r\n\r\n<div class=\"topics\"> \r\n<h4 class=\"third-color fa-2x font-light font-size-24\">Dimples SleepSac – Summer, Mid-Season and Winter Weight</h4>\r\n<p>Cold water wash</p>\r\n<p>Do Not Soak, Bleach, Tumble Dry or Dry Clean</p>\r\n<p>Warm iro</p>\r\n  </div>  \r\n  \r\n  <div class=\"topics\">\r\n  <h4 class=\"third-color fa-2x font-light font-size-24\">BabyBliss by Dimples Nursery Furniture</h4>\r\n<p><em>Bassinette 100% natural woven Aircell cotton hammock, ChangeTable -100% natural woven cotton drill change mat</em></p>\r\n\r\n<p>Cold water wash</p>\r\n<p>Do Not Soak, Bleach, Tumble Dry or Dry Clean</p>\r\n<p>Warm iron </p>\r\n</div>     \r\n          \r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>',	'2017-08-08 05:47:18',	'2017-09-07 11:41:15',	1,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	0),
(12,	'Press',	'1column',	NULL,	NULL,	'press',	NULL,	'<div class=\"col-sm-3\">{{widget type=\"Ves\\Megamenu\\Block\\Widget\\Menu\" alias=\"dimple-story-menu\"}}</div>\r\n\r\n <div class=\"col-sm-9\">\r\n      <h1 class=\"display-4 base-heading\">Press</h1>\r\n      <div class=\"press globel-right-content\">\r\n        <div class=\"col-md-4 col-sm-6\">\r\n      <div class=\"press-block\">\r\n    <img src=\"{{media url=\"wysiwyg/press1.png\"}}\" alt=\"\" class=\"img-responsive\" />\r\n      \r\n      <h2 class=\"second-heading\" >From four loads of laundry a day to\r\ncooking in bulk and doing the school\r\nrun in a VAN: Mum of FOURTEEN who\r\n\'likes being busy\' shares her secrets.</h2>\r\n<div class=\"logo-dark mt-20\"><img src=\"{{media url=\"wysiwyg/img1-logo.jpg\"}}\" alt=\"\" /></div>\r\n<a href=\"http://www.dailymail.co.uk/femail/article-4454184/Mother-FOURTEEN-grandmother-23-shares-secrets.html\" class=\"add-info--link mt-10\">More</a>\r\n      \r\n      \r\n      </div>\r\n      \r\n      </div>\r\n      \r\n      <div class=\"col-md-4 col-sm-6\">\r\n      <div class=\"press-block\">\r\n<img src=\"{{media url=\"wysiwyg/press2.png\"}}\" alt=\"\"class=\"img-responsive\" />\r\n      \r\n      <h2 class=\"second-heading\" >Child-proofing: Mum of 14 says not\r\nevery lesson should be learned the\r\nhard way</h2>\r\n<div class=\"logo-dark mt-20\"><img src=\"{{media url=\"wysiwyg/img2-logo.jpg\"}}\" alt=\"\"class=\"img-responsive\" /></div>\r\n<a href=\"http://www.stuff.co.nz/life-style/home-property/91971088/childproofing-mum-of-14-says-not-every-lesson-should-be-learned-the-hard-way\" class=\"add-info--link mt-10\">More</a>\r\n      \r\n      \r\n      </div>\r\n      \r\n      </div>\r\n      \r\n     \r\n      <div class=\"col-md-4 col-sm-6\">\r\n      <div class=\"press-block\">\r\n<img src=\"{{media url=\"wysiwyg/press3.png\"}}\" alt=\"\" class=\"img-responsive\" />\r\n      \r\n      <h2 class=\"second-heading\" >You’ve Got to Be Kidding - 20/20</h2>\r\n<div 