(14,	'Instructional Videos',	'1column',	NULL,	NULL,	'instructional-videos',	NULL,	'<div class=\"col-sm-3\">{{widget type=\"Ves\\Megamenu\\Block\\Widget\\Menu\" alias=\"top-tips-cms-menu\"}}</div>	   \r\n\r\n <div class=\"col-sm-9\">\r\n      <h1 class=\"base-heading\">Confident care – looking after your new baby </h1>\r\n      <div class=\"free-sleep-help globel-right-content\">\r\n      <p>Dressing, bathing, and swaddling can all seem daunting when you’re faced with a tiny, delicate little one.  </p>\r\n      <p>That’s why we’ve created a series of instructional videos – we want to help first-time parents feel comfortable and confident caring for their baby. Our videos show you how to dress and bathe a newborn, and give you step by step instructions about how to use some of our swaddles and sleep products.  </p>\r\n      <p class=\"m-b-40\">If there’s a topic we haven’t covered that you would like to see,<span class=\"span third-color\" style=\"font-weight:500\"> get in touch to make a suggestion now.</span>  </p>\r\n        <div class=\"row\">\r\n          <div class=\"col-md-4 video-section\">\r\n            <div class=\"embed-responsive embed-responsive-16by9 \">\r\n              <iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/DXSHuEGo3QA\">\r\n              </iframe>\r\n            </div>\r\n            <p>How to dress your newborn baby - demonstration video</p>\r\n          </div>\r\n          \r\n          <div class=\"col-md-4 video-section\">\r\n            <div class=\"embed-responsive embed-responsive-16by9 \">\r\n              <iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/oFU2eZpR8o4\">\r\n              </iframe>\r\n            </div>\r\n            <p>Snugglesac Demonstration Video - new innovative sleeping solution!</p>\r\n          </div>\r\n          \r\n          <div class=\"col-md-4 video-section\">\r\n            <div class=\"embed-responsive embed-responsive-16by9 \">\r\n              <if