is within New Zealand from time of shipping, your order should arrive within five to ten working days* (due to our garments being hand embroidered). Please provide only physical address details when placing an order as the courier is unable to deliver to PO Box addresses. </span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"background:white\"><span style=\"line-height:14.4pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">*Please allow extra delivery time for rural addresses and bulk items.</span></span></span></span><br>\r\n<br>\r\n<b><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Shipping - International</span></span></span></b><b> </b><br>\r\n<span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">International orders may take up to 14 business days (due to our garments being hand embroidered) via New Zealand postal service. (Note: shipping times may vary seasonally). Please Note - International orders may be subject to additional shipping fees that need to be paid prior to the order being shipped if the order is oversized. </span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"background:white\"><span style=\"line-height:14.4pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">We only offer international shipping to the below countries:</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"background:white\"><span style=\"line-height:14.4pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Australia, Austria, Belgium, Canada, China, Cook Islands, Costa Rico, Croatia, Czech Republic, Denmark, Ecuador, El Salvador, Finland, France, Germany, Greece, Hong Kong, Hungary, Ireland, Italy, Japan, Macau, Malaysia, Mexico, Netherlands, Norway, Philippines, Poland, Portugal, Romania, Samoa, Singapore, Slovenia, South Korea, Spain, Sweden, Switzerland, Taiwan, Thailand, Tonga, UK, USA, Vanuatu, Uruguay and Vietnam. </span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"background:white\"><span style=\"line-height:14.4pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">If your country is <b>not</b> listed, please contact us to arrange a shipping quote.</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"background:white\"><span style=\"line-height:14.4pt\"><b><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Large bulky/heavy items may be subject to additional shipping fees. </span></span></span></span></b><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Please check the product page to see if we ship the particular item internationally. Some heavy/bulky items are only available to be purchased within New Zealand, however we are happy to obtain an international shipping quote for you.</span></span></span></span></span></span><br>\r\n&nbsp;</p>\r\n\r\n<hr>\r\n<p><br>\r\n<span style=\"line-height:normal\"><b><span style=\"font-size:13.5pt\"><span style=\"background:white\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Returns policy</span></span></span></span></span></b></span></p>\r\n\r\n<p><span style=\"background:white\"><span style=\"line-height:14.4pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Dimples by Jane Anne offers a 100 percent satisfaction guarantee on all <b>Dimples branded products</b> sold online and in our Dimples Babywear boutiques. Dimples branded products are designed and produced with great care and attention to detail. We hope you will be delighted with them. </span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"background:white\"><span style=\"line-height:14.4pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">If you are not completely satisfied with your purchase, please return the items within 14 days for a full refund or exchange. Provided that:</span></span></span></span></span></span></p>\r\n\r\n<ul style=\"list-style-type:square\">\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">You have proof of purchase and</span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">You purchased the product in the last 14 days and</span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">The product is in original condition including its original packaging and</span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">The product has not been washed, worn or used and</span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">The sewn-in labels are attached and</span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">It is not a product that is listed in the<b> </b>Exceptions section</span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"background:white\"><span style=\"line-height:14.4pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Please note - we are happy to exchange Dimples branded garments for different sizes, but this is subject to availability. </span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"background:white\"><span style=\"line-height:14.4pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Goods are returned to Dimples at your expense, however if products are faulty, we will refund or credit the cost of the return postage. Please refer to the items which are listed in the exceptions section below as these items are non-refundable or exchangeable, so please choose carefully. </span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"background:white\"><span style=\"line-height:14.4pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Please email your details to </span></span></span></span><a href=\"mailto:info@dimples.co.nz\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"letter-spacing:.45pt\">info@dimples.co.nz</span></span></span></a><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\"> Otherwise please contact us if you require any advise. </span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"background:white\"><span style=\"line-height:14.4pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Please return your item to the following address:<br>\r\nDimples by Jane Anne<br>\r\nUnit B, 1 Charann Place<br>\r\nAvondale<br>\r\nAuckland 1026</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-top:3.75pt; margin-right:0cm; margin-bottom:3.75pt; margin-left:0cm\"><span style=\"background:white\"><span style=\"line-height:14.25pt\"><b><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\"><span style=\"letter-spacing:.45pt\">Exceptions</span></span></span></span></b></span></span></p>\r\n\r\n<p style=\"margin-top:3.75pt; margin-right:0cm; margin-bottom:3.75pt; margin-left:0cm\">&nbsp;</p>\r\n\r\n<p style=\"margin-top:3.75pt; margin-right:0cm; margin-bottom:3.75pt; margin-left:0cm\"><span style=\"background:white\"><span style=\"line-height:14.25pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Please choose carefully as we <b>do not</b> offer <b>exchanges or refunds</b> on the following items unless the item is faulty,</span></span></span></span></span></span></p>\r\n\r\n<ul style=\"list-style-type:square\">\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">All Nursery Furniture &ndash; including mattresses </span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Swimwear</span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">All hardware such as Prams/Strollers, Car Seats, High Chairs, Leaf Seats, Travel cots</span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Gift Vouchers</span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Sale items</span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Dorothy Waide\'s - Tutorial Video Collection </span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Also, due to health and Safety regulations we are <b>unable</b> to offer an <b>exchange or refund</b> on any of the following items unless the item is faulty,</span></span></span></span></span></span></p>\r\n\r\n<ul style=\"list-style-type:square\">\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Teethers</span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Baby Bottles</span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Dummies</span></span></span></span></span></span></span></li>\r\n	<li><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list 36.0pt\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#5f5f5f\"><span style=\"letter-spacing:.45pt\">Skincare &ndash; including lotions and soothing oils</span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<div>\r\n<hr style=\"color:#5f5f5f\" width=\"100%\" noshade=\"noshade\" size=\"1\" align=\"left\"></div>\r\n\r\n \r\n</div>\r\n<br />\r\n<br />',	'2017-08-08 12:05:39',	'2017-08-17 09:28:56',	0,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	0),
(16,	'Delivery and Returns',	'1column',	NULL,	NULL,	'delivery-and-returns',	NULL,	'<div class=\"col-sm-3 col-xs-12\">{{widget type=\"Ves\\Megamenu\\Block\\Widget\\Menu\" alias=\"terms-menu-cms\"}}</div>	\r\n<div class=\"col-sm-9 col-xs-12\">\r\n<dl class=\"custom-page\">\r\n<dt class=\"heading-2\">Delivering Dimples – shipping and returns </dt>\r\n<dd>\r\nDimples is a proud New Zealand business, but we have fans everywhere. We ship our babywear, accessories, and other baby products to people all over the world. \r\n<br><br>\r\nHere’s how it works:\r\n</dd>\r\n\r\n<dt class=\"heading-2\">Delivery details </dt>\r\n<dd>If your product is in stock, we will dispatch it within five working days of receiving your order. Occasionally, a product is out of stock. In that case, we will let you know and send your order out as soon as it is available. </dd>\r\n\r\n<dt class=\"heading-2\">Shipping in New Zealand </dt>\r\n<dd>If your delivery address is in New Zealand, your order should arrive within 5-10 working days. Bulky items and rural addresses can take a bit longer. We can’t deliver to PO Boxes, so make sure you give us a physical address. </dd>\r\n\r\n<dt class=\"heading-2\">International Shipping</dt>\r\n<dd>International Orders may take 14+ business days to arrive – partly because we hand embroider each garment before sending it off. Large or bulky international orders may require extra shipping fees – we’ll let you know before we ship your items. Some large, heavy items are only available within New Zealand, so make sure to check the product page before you order. \r\n<br><br>\r\nWe offer international shipping to: \r\n<br><br>\r\nAustralia, Austria, Belgium, Canada, China, Cook Islands, Costa Rica, Croatia, Czech Republic, Denmark, Ecuador, El Salvador, Finland, France, Germany, Greece, Hong Kong, Hungary, Ireland, Italy, Japan, Macau, Malaysia, Mexico, Netherlands, Norway, Philippines, Poland, Portugal, Romania, Samoa, Singapore, Slovenia, South Korea, Spain, Sweden, Switzerland, Taiwan, Thailand, Tonga, UK, USA, Vanuatu, Uruguay and Vietnam.\r\n<br><br>\r\nIf your country is not listed, <a href=\"{{store direct_url=\"contact\"}}\">get in touch</a> and we will give you a shipping quote. \r\n\r\n</dd>\r\n\r\n<dt class=\"heading-2\">Delivery details </dt>\r\n<dd>If your product is in stock, we will dispatch it within five working days of receiving your order. Occasionally, a product is out of stock. In that case, we will let you know and send your order out as soon as it is available. </dd>\r\n\r\n<hr>\r\n<dt class=\"heading-2\">Returns</dt>\r\n<dd>\r\nEvery Dimples-branded product is made with love and care. We use quality materials, have high manufacturing standards, and hand-embroider every garment. We hope you will be delighted when your products arrive.\r\n<br><br>\r\nHowever, if you’re not completely satisfied with your purchase, we can refund or exchange most items*. \r\n<br><br>\r\nMake sure:\r\n. You have proof of purchase<br>\r\n. The product was purchased in the last 14 days<br>\r\n. The product is in original condition, with original packaging and labels<br>\r\n. The product has not been washed, worn, or used\r\n<br><br>\r\nYou will need to return products at your own expense if you change your mind, but we will refund or credit postage if the product is faulty. \r\n<br><br>\r\n*Before you buy, check the exceptions for a list of items that can’t be refunded or exchanged, and choose carefully. \r\n</dd>\r\n<br>\r\n<hr>\r\n<dt class=\"heading-2\">Exceptions</dt>\r\n<dd>\r\nWe do not offer returns or exchanges on these items unless the product is damaged or faulty. \r\n<br><br>\r\n. All nursery furniture – including mattresses<br>\r\n. Swimwear<br>\r\n. All hardware – including prams/strollers, car seats, high chairs, leaf seats and travel cots<br>\r\n. Teethers, baby bottles and dummies<br>\r\n. Skincare – including lotions and soothing oils <br>\r\n. Gift vouchers<br>\r\n. Sale items<br>\r\n. Dorothy Waide\'s tutorial video collection\r\n<br><br>\r\nSend returns to: <br>\r\nDimples by Jane Anne<br>\r\nUnit B, 1 Charann Place<br>\r\nAvondale<br>\r\nAuckland 1026<br>\r\n<br>\r\nIf you’re unsure about a return, <a href=\"{{store direct_url=\"contact\"}}\">get in touch</a> and we’ll be happy to help.\r\n</dd>\r\n </dl>\r\n</div>',	'2017-08-16 05:33:50',	'2017-09-01 12:30:02',	1,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	0),
(17,	'Testimonials',	'1column',	NULL,	NULL,	'testimonials',	'Testimonials',	'<div class=\"col-sm-3\">{{widget type=\"Ves\\Megamenu\\Block\\Widget\\Menu\" alias=\"dimple-story-menu\"}}</div>\r\n <div class=\"col-sm-9\">\r\n<div class=\"plain_content testimonials\">\r\n <div class=\"col-sm-12 col-xs-12\">\r\n <p> We receive a lot of feedback from satisfied customers and would love to share some with you. If you feel our products or service has exceeded your expectations, we would love to hear from you.</p>\r\n</div>\r\n\r\n<hr>\r\n\r\n <div class=\"col-sm-12 col-xs-12\">\r\n\r\n<p> I can\'t say enough about Dimples babywear. Both my boys wore it when they were babies and even now have Dimples pjs(they are 4 and 5 now). It lasts for ever and has been past on to new owners and friends . I always buy Dimples for friends because it\'s such a good product. Love love love x Julie-Anne, March 2014</p>\r\n</div>\r\n<hr>\r\n\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p>I love Dimples by Jane Anne, I have always dressed my babies in Dimples, it is amazing quality, wears incredibly well and washes up really nice every time. I love the the designs they are easy to dress your baby in, the colours and fabric are lovely. I love how my babies look in their Dimples, I always get so many comments about how lovely they look. Kelley, March 2014</p></div>\r\n<hr>\r\n  <div class=\"col-sm-12 col-xs-12\">\r\n<p>Dimples is our favourite brand! We love the fact its designed and MADE in New Zealand. Its of the highest quality. Perfect for when you want the best for your baby. The sizes are generous which means you get the maximum amount of use out of them. The designs are innovative and stylish. A lot of time and thought goes into the design of each garment along with the entire range. Well worth every cent for the quality you get. Trudi, March 2014</p>\r\n&nbsp;</div>\r\n\r\n<hr>\r\n\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<div class=\"text_exposed_root text_exposed\" id=\"id_5328d823a934b1f99237391\">\r\n<p>We love Dimples! Not only is the clothing of an amazing quality, it is also very versatile. You can mix and match between the collections and fabrics to suit almost any occasion or season! It washes well - which is great as our daughter is nearly 10 months old, very mobile, in to absolutely everything and is at the <span class=\"text_exposed_hide\">...</span><span class=\"text_exposed_show\">stage where bibs no longer offer the protection they used to! I am a huge fan of all things merino and have found my daughter is most content and sleeps well when dressed in merino or the merino blends for the warmer months. The fact that the the Dimples clothing is New Zealand made is the cherry on the top! As for some of the extras we have bought from Dimples I cannot fault any of them either - we have purchased the Maxi Cosi Pebble Capsule (carseat), Nuna Leaf, Cot Mattress - Delux Innersprung, Quinny Buzz 3 Pram with the Dreami Bassinet and the Nuna Zaaz Highchair. Quality products from a lovely lady who really knows her stuff! Thanks Dimples xxx</span>&nbsp; Sherryn, March 2014</p></div></div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p> Wow, order just arrived and is truly divine.<br>\r\nNo comparison with other baby merino on the market.<br>\r\nBrilliant work Dimples team. Thank you so much, Anita February 2014</p>\r\n</div> \r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<span class=\"messageBody\" data-ft=\"{&quot;type&quot;:3,&quot;tn&quot;:&quot;K&quot;}\"><p> Thanks for such quick delivery of your items, wonderful service and such a big job with orders from your flash sales, greatly appreciated, just love the items I got. Melanie February 2014</p> </span>\r\n</div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p>Wow my order has just arrived, the clothing is even better then I had expected, thank you so very much, now my baby just needs to grow some so he can wear them (bought 12months, baby only 3 weeks), or maybe I can convince husband that we need some more stuff. Thank you so much again I am a very happy new mum (again) <span class=\"emoticon_text\">?</span> dimples clothes. February 2014 </p> </div>\r\n<hr>\r\n  <div class=\"col-sm-12 col-xs-12\">\r\n<span class=\"messageBody\" data-ft=\"{&quot;type&quot;:3,&quot;tn&quot;:&quot;K&quot;}\"><p> Back in October we won this DIMPLES swimsuit...it is awesome! Thank you so much! Georgina January 2014</p></span></div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<span class=\"messageBody\" data-ft=\"{&quot;type&quot;:3,&quot;tn&quot;:&quot;K&quot;}\"><p>Thanks for your awesome customer service and speedy delivery of my order - we are big Dimples fans! Natasha January 2014</p></span></div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<span class=\"messageBody\" data-ft=\"{&quot;type&quot;:3,&quot;tn&quot;:&quot;K&quot;}\"><p>My wee Merino Pj\'s arrived today and they are absolutely beautiful! Cannot wait to use them on my brand new bubba!! Thanks. Sarah January 2014</p></span> </div> \r\n\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p>Hi there i have followed your clothing range since my first baby was born almost 11 years ago she had a little white onsie with a bee and matching hat that i washed and got as much wear as i could before she grew out of it! Then ten years later i had a son (he will be 1 on the 20th of jan) my budget didn\'t stretch far enough to get him any of your lovely clothing but luckily a great friend of mine brought him two little blue suits and a wrap which he wore as much as possible im now due to have another (big surprise) baby boy and am madly trying to find the two suits to get ready to pass on (except the wrap because Travis sleeps with it every night) they still look perfect despite having washed them so much we are still unpacking from a move, its the only thing im panicking about finding <span class=\"emoticon_text\">:)</span> i just thought it would be nice for you to hear how lovely we think your clothing is and although we cant dress our babies in your clothing full time the things we have are able to be passed on still in fantastic condition even after me making my babies wear it as much as possible they are just such great quality and its always nice to get positive feedback <span class=\"emoticon_text\">:)</span> have a lovely night<br>\r\nLila <span class=\"emoticon_text\">:) January 2014</span> </p> </div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<span class=\"messageBody\" data-ft=\"{&quot;type&quot;:3,&quot;tn&quot;:&quot;K&quot;}\"><p>Thank you so much for sun hat all your products are gorgeous xx Stephanie december 2013</p> </span></div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p>\"Every mother will know the little bit of pleasure that comes from making your baby look beautiful. I love the quality and practicality of Dimples babywear, but most of all I love the joy I get from making my little boy look so stylish\"\r\n<strong> Bronwyn September 2013 </strong> </p>\r\n</div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p> Just wanted to email you to say thanks for bringing a bit of your range down to farmers in christchurch. We have just relocated from auckland and i used to go into your new market store all the time, buying for friends and my sisters little ones and now i have the pleasure and viewing your range again. There is nothing as nice as your range, i just love it , my husband and i will be starting for a family in the coming months and i already know what i will be buying, so thank u.<strong> Amber June 2013</strong> </p>\r\n </div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\"><p> I\'ve been impressed with the speed of your responses and you\'ve been very helpful.\r\n<strong> Nick&nbsp; July 2013</strong></p>\r\n</div>\r\n\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<div style=\"-webkit-text-size-adjust: auto\"><p>I received my order today. Thank you!! My daughter\'s name is Rose so your clothes are PERFECT! She\'s also pretty special so she deserves them ;-) </p></div>\r\n</div>\r\n\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p>We\'ve been using your pjs for our boys for years now and absolutely love them. Just wanted to say thank you for making the everyday act of dressing my kids into something enjoyable. I love knowing they\'re comfortable, warm and BEAUTIFUL!!<br>\r\n<strong> Best, Jane July 2013</strong> </p>\r\n</div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p> Since the arrival of our wee girl 2 and half years ago and now another wee girl 5 months, I have been a loyal supporter of your products.&nbsp; I am from a family of farmers in the high country of the South Island producing the Merino wool for your fabulous New Zealand made garments and it\'s refreshing to know that there is still some Kiwi brands that support New Zealand sourced and made. Dimples washes up like new every time and our 2nd wee girl is wearing clothing that her sister thrashed and they look no older than the day they were purchased\" July 2013</p>\r\n</div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p>\"I don\'t know how you did it but the parts for the bassinette arrived today, Monday!! We will set it all up tonight for a baby that is expected either this Wednesday or Thursday.<br>\r\nThank you so much. Your service has been exemplary.\"<br>\r\nAllyson from Victoria, Australia -&nbsp; Feb 2013</p>\r\n</div> <hr>\r\n  <div class=\"col-sm-12 col-xs-12\">\r\n<p> I just wanted to let you know that the key arrived today &ndash; thank you very much for sorting this out for us, excellent customer service.<br>\r\n&nbsp;<br>\r\nRegards,<br>Amber June 2013\r\nAmy (March 2013)</p>\r\n</div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p> <strong>Tracey Bryce said...</strong>\r\nLove, love, love the new Coconut Ice range. It\'s awesome.<br>\r\n\r\nAPRIL 27 2011</p>\r\n</div>\r\n<hr> \r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p> <strong>Tracey Hall said...</strong><br>\r\n\r\n Thanks so much for the new bib I won. It catches everything!<br>\r\n\r\n<strong> APRIL 21 2011</strong> </p></div>\r\n<hr>\r\n\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p>\r\n<strong>Tracey Bryce said...</strong>\r\nMy wee mans first wedding was at five months wearing Dimples Romper, Dimples Cardigan, Dimples Booties and Dimples Beanie. Oh, he looked so handsome and got so many comments on his wee outfit.\r\nAPRIL&nbsp; 01 2011\r\n </p>\r\n</div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p>\r\n<strong>Rosalind said...</strong>\r\nDear Dimples,\r\n<br>\r\nI just want to thank you for the speedy delivery of my order. My daughter in law\'s baby shower is tomorrow afternoon at a venerable club in Boston. I so much wanted to have her open something made in New Zealand.<br>\r\n\r\nMy husband and I are New Zealanders but have lived in Sudbury, a town 20 miles west of Boston, Massachusetts, for many years. Our twin boys were born 36 years ago in National Women\'s.  With many thanks,<br>\r\n<strong>Rosalind Wood</strong><br>\r\nMassachusetts  JULY 22 2010</p>\r\n\r\n</div>\r\n\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n<p> <strong>Sarah said...</strong><br>\r\n<br>\r\nWrap arrived today - Thank you! It\'s fantastic :-)<br>\r\nSophie will be warm and snug in that tonight!<br>\r\n<br>\r\nRegards,<br>\r\nSarah<br>\r\nJULY 15 2010</p>\r\n</div>\r\n<hr>\r\n <div class=\"col-sm-12 col-xs-12\">\r\n\r\n<p>\r\n<strong>Kathryn said...</strong>\r\n\"Have received my order and I have to tell you I am thrilled with it. I am taking it over to the UK for presents for a new neice and nephew and I know they will love it.\"\r\n\r\n<strong>Kathryn A</strong>\r\n\r\nTaupo JUNE 24 2010</p>\r\n</div>\r\n<hr> \r\n <div class=\"col-sm-12 col-xs-12\"><p>\r\n<strong>Karen said...</strong>\r\n\r\nThank you. I purchased the Dimples winter sleep sac and it is lovely and soft and keeps Molly lovely and warm. She kicks off her pyjama pants most nights, wee wriggler that she is, so keeping her warm is important in trying to get her sleeping through the night. I haven\'t used it as a jumpsuit yet because she is quite good at crawling in it.\r\n\r\n<strong>Karen, MAY 22, 2010 </strong>\r\n</p>\r\n\r\n</div>\r\n</div></div>',	'2017-08-24 05:14:06',	'2017-09-05 10:04:23',	1,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	0),
