(24,	'Checklist',	'1column',	NULL,	NULL,	'checklist',	NULL,	'<div class=\"col-sm-3 col-xs-12\">{{widget type=\"Ves\\Megamenu\\Block\\Widget\\Menu\" alias=\"top-tips-cms-menu\"}}</div>\r\n\r\n   \r\n <div class=\"col-sm-9 col-xs-12\">\r\n	<h1 class=\"display-4 base-heading\">Bringing your baby home – the essentials</h1>\r\n	<div class=\"checklist globel-right-content\">\r\n		<div class=\"row\">\r\n			<div class=\"col-md-8 col-xs-12 col-sm-8\">\r\n				<p>Newborns have simple needs – blankets, clothes, nappies, a safe place to sleep\r\n					But unless you\'ve done it before, it\'s difficult to know exactly what to buy before\r\n					you bring your precious baby home.</p>\r\n				<p>We\'ve created a checklist of essentials (along with some nice-to-have extras) so\r\n					you can get the practical necessities ready for your new baby.</p>\r\n				<p>If you\'re about to have your first and need to stock up on the essentials, think\r\n					about setting up a <a href=\"#\">Dimples Gift Registry</a> so friends and family can help.</p>\r\n			</div>\r\n			<div class=\"col-md-4 col-xs-12 col-sm-4\"><img src=\"{{media url=\"wysiwyg/baby.png\"}}\" alt=\"\" /> </div>\r\n			<div class=\"clearfix\"></div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"col-md-12 clearfix col-xs-12\">\r\n	<div class=\"sky-light\">\r\n		<h1 class=\"base-heading\">Essentials Checklist</h1>\r\n	</div>\r\n</div>\r\n<div class=\"size-detail\">\r\n	<div class=\"size-detail-inner\">\r\n		<div class=\"col-md-4 col-sm-6\">\r\n			<div class=\"clothing-block\">\r\n				<h3 class=\"second-heading\">Clothing essentials</h3>\r\n				<ul class=\" custom-checkbox\">\r\n					<h4>The must-haves</h4>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input checked=\'true\' type=\'checkbox\'>\r\n							<span>3 x Stretch-n-grows</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>3 x Gowns</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>3 x Merino Bodysuits</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>3 x Cotton Bodysuits</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>3 x Sleeveless Bodysuits</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>4 x Socks</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>2 x Cardigans</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>4 x Pants</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>10 x Bibs</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>2 x Merino Beanies</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>1 x Sunhat</span> </label>\r\n					</li>\r\n				</ul>\r\n				<ul class=\" custom-checkbox\">\r\n					<h4>Nice to have</h4>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input checked=\'true\' type=\'checkbox\'>\r\n							<span>3 x Booties</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>2 x Mittens</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>1 x \'Going home from Hospital\' Outfit</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>Bodysuits and leggings to mix and\r\n							match</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>1 x Shawl/receiving blanket</span> </label>\r\n					</li>\r\n				</ul>\r\n			</div>\r\n		</div>\r\n		<div class=\"col-md-4 col-sm-6\">\r\n			<div class=\"clothing-block\">\r\n				<h3 class=\"second-heading\">Sleep Essentials</h3>\r\n				<ul class=\"custom-checkbox\">\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input checked=\'true\' type=\'checkbox\'>\r\n							<span>Cot and bassinet or Cosy Crib</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>4 x Swaddles</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>3 x Bassinet/cot sheet sets</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>2 x Blankets</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>1 x Shawl/receiving blanket</span> </label>\r\n					</li>\r\n					<h4>Nice to have</h4>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n						<input checked=\'true\' type=\'checkbox\'>\r\n						<span>\r\n						<div class=\"text-checkbox-content\">A sleeping bag is fabulous for keeping\r\n							baby warm and cosy all night</div>\r\n						</span>\r\n						</label>\r\n					</li>\r\n				</ul>\r\n				<ul class=\"custom-checkbox\">\r\n					<h3 class=\"second-heading\">Bath Essentials</h3>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input checked=\'true\' type=\'checkbox\'>\r\n							<span>Baby bath</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>10 x Washcloths</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>2 x Hooded towels</span> </label>\r\n					</li>\r\n					<h4>Nice to have</h4>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>Carrier</span> </label>\r\n					</li>\r\n				</ul>\r\n				<ul class=\"custom-checkbox\">\r\n					<h3 class=\"second-heading\">Out and About essentials</h3>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input checked=\'true\' type=\'checkbox\'>\r\n							<span>Capsule or infant carseat</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>Nappy Bag</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>Pram or Stroller</span> </label>\r\n					</li>\r\n					<h4>Nice to have</h4>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>Carrier</span> </label>\r\n					</li>\r\n				</ul>\r\n			</div>\r\n		</div>\r\n		<div class=\"col-md-4 col-sm-6\">\r\n			<div class=\"clothing-block\">\r\n				<h3 class=\"second-heading\">Changing Essentials</h3>\r\n				<ul class=\"custom-checkbox\">\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n						<input checked=\'true\' type=\'checkbox\'>\r\n						<span>\r\n						<div class=\"text-checkbox-content\">Nappies – and lots of them. Budget\r\n							on needing 8-10 per day. If you are\r\n							planning to use cloth nappies\r\n							buying 12 to 18 is recommended.</div>\r\n						</span>\r\n						</label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n						<input type=\'checkbox\'>\r\n						<span>\r\n						<div class=\"text-checkbox-content\">Wipes – Newborns skin is so\r\n							delicate we recommend initially\r\n							just using muslin cloths soaked in\r\n							warm water at nappy changing. A\r\n							pack of wipes is handy when out\r\n							and about.</div>\r\n						</span>\r\n						</label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>Nappy bucket with lid for cloth\r\n							nappies, a bin for disposables is also\r\n							handy.</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>Change mat</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n							<input type=\'checkbox\'>\r\n							<span>Nappy Cream</span> </label>\r\n					</li>\r\n					<li>\r\n						<label class=\'with-square-checkbox\'>\r\n						<input type=\'checkbox\'>\r\n						<span>\r\n						<div class=\"text-checkbox-content\">Nappy bucket with lid for cloth\r\n							nappies, a bin for disposables is also\r\n							handy.</div>\r\n						</span>\r\n						</label>\r\n					</li>\r\n				</ul>\r\n			</div>\r\n		</div>\r\n		<div class=\"clearfix\"></div>\r\n		<div class=\"col-md-12 checklist-botom\" style=\" border-top: solid 1px #e1c9b0;\"> <a href=\"#\" class=\"add-info--link mt-20 download\">DOWNLOAD CHECKLIST</a></div>\r\n	</div>\r\n	<div class=\"gift-box\">\r\n		<div class=\"col-md-6 col-sm-6\">\r\n\r\n\r\n\r\n			<h1 class=\"display-4 base-heading\">Great gift ideas</h1>\r\n			<p class=\"second-heading secondary-color\">Dimples gift registry makes things really\r\n				easy for you to make sure you get\r\n				everything you need for your baby\'s arrival.</p>\r\n			<a href=\"#\" class=\"add-info--link mt-20 download\">MORE</a> </div>\r\n		<div class=\"col-md-6 col-sm-6\">\r\n			<div class=\"row\">\r\n				<div class=\"col-md-6 col-sm-6\">\r\n					<div class=\"product-block-cheklist\"> <img src=\"{{media url=\"wysiwyg/gift-dummy-image.png\"}}\" alt=\"\"  class=\"img-responsive\"/></div>\r\n				</div>\r\n				<div class=\"col-md-6 col-sm-6\">\r\n					<div class=\"product-block-cheklist\"> <img src=\"{{media url=\"wysiwyg/gift-dummy-image.png\"}}\" alt=\"\"  class=\"img-responsive\"/></div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>',	'2017-08-31 07:02:14',	'2017-09-06 11:22:38',	1,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	0),
