 <tr>\r\n    <td>Xtra Large</td>\r\n    <td>49-54 cm</td>\r\n    <td>2-4 Years</td>\r\n  </tr>\r\n  \r\n</table>\r\n</div>\r\n          </div>\r\n          \r\n          <div class=\"clearfix\"></div>\r\n          \r\n          \r\n          </div>\r\n        </div>\r\n      </div>',	'2017-08-31 07:05:05',	'2017-09-05 13:01:07',	1,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	0),
(26,	'Free Sleep Help',	'1column',	NULL,	NULL,	'free-sleep-help',	NULL,	'<div class=\"col-sm-3\">{{widget type=\"Ves\\Megamenu\\Block\\Widget\\Menu\" alias=\"top-tips-cms-menu\"}}</div>	    \r\n\r\n<div class=\"col-sm-9\">\r\n      <h1 class=\"display-4 base-heading\">Sweet dreams – helping your baby sleep better \r\n</h1>\r\n     <!-- <h3 class=\"third-color fa-2x\">Would you like some free sleep help? Email our sleep hotline -\r\nsleephelp@dimples.co.nz</h3>-->\r\n      <div class=\"free-sleep-help globel-right-content\">\r\n        <div class=\"row\">\r\n          <div class=\"col-md-12\">\r\n            <p>\r\n            All parents will struggle with baby sleep at some point, but it doesn’t have to be a constant battle. If you’re finding it difficult to get your baby to settle, sleep well during the day, or sleep through the night, we can help. </p>\r\n\r\n            <p><span class=\"span third-color\" style=\"font-weight:500\">Dorothy Waide is our baby sleep consultant. </span>She has been a post-partum care provider and ‘baby whisperer’ since 1990, and worked as a Karitane nurse for almost 20 years before that. She supports parents dealing with sleep problems through her company <span class=\"span third-color\" style=\"font-weight:500\">Baby Help,</span> and offers advice to Dimples’ customers as well. </p>\r\n            \r\n            \r\n            <p>When you’re struggling with your baby, it can be helpful to hear from other parents dealing with similar issues. Read through our case studies to hear from other parents dealing with a range of sleep problems – and to find out what helped them. </br>\r\n\r\n\r\n          </div>\r\n          \r\n          \r\n          <div class=\"clearfix\"></div>\r\n          \r\n          <div class=\"col-md-12 topics\">\r\n<!--          <h3 class=\"third-color fa-2x\">Click the below topics to read some questions and answers from other mum’s:</h3>\r\n-->          \r\n\r\n    \r\n    <div class=\"panel-group\" id=\"accordion\" role=\"tablist\" aria-multiselectable=\"true\">\r\n\r\n        <div class=\"panel panel-default\">\r\n            <div class=\"panel-heading\" role=\"tab\" id=\"headingOne\">\r\n                <h4 class=\"panel-title\">\r\n                    <a role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapseOne\" aria-expanded=\"true\" aria-controls=\"collapseOne\">\r\n                        <i class=\"more-less glyphicon glyphicon-plus\"></i>\r\n                       3 month old that won\'t sleep\r\n                    </a>\r\n                </h4>\r\n            </div>\r\n            <div id=\"collapseOne\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingOne\">\r\n                <div class=\"panel-body\">\r\n                     <div class=\"postclass pageclass clearfix entry-content\">\r\n			  <p></p>\r\n<p><strong>Question:</strong></p>\r\n<p>I am at my wits end with my third son. He is three months old today, and his sleep is a disaster. His problems are twofold:</p>\r\n<p> 1) He will only sleep for 45 minute stretches, meaning for naptime he won’t nap more than 45 minutes. (If he actually goes a full 45 minutes, that is actually good. He often will only stay asleep for 20 minutes or even less.) He must be put in his crib completely asleep–he will not settle down to sleep himself. He will generally take 2-3 of these catnaps during the day and that’s it.</p>\r\n<p>2) For bedtime he must be rocked/nursed to sleep and won’t sleep past 45 minutes. Then it is a struggle to get him to go back to sleep. I used to take him out and rock him back to sleep and attempt to do that over and over again until he would stay asleep. For the last 4-6 weeks I have tried to do it without removing him from his crib, since I know I was promoting an awful habit by rocking him to sleep. I will shush him, pat him, etc until he quiets down but then I’ll leave the room and he starts the screaming all over again. This usually goes on for an hour. </p>\r\n<p>Due to my desperation I have tried both ways of putting him to sleep: putting him in completely asleep after being rocked, jiggled, etc, and/or putting him in awake but very drowsy so he gets used to falling asleep on his own. Needless to say, neither one works. If I put him in asleep he wakes up after 45 minutes, and if he falls asleep on his own which he has done maybe two or three times, he still wakes up after 45 minutes.</p>\r\n<p>He doesn’t take a pacifier (I’ve tried them all); he does suck on his hands during the day, so I’ve tried swaddling him with his arms out so he has access to his hands, but he won’t try to use them to self-soothe in his crib.</p>\r\n<p>I breastfeed with supplementation, so I’ve tried cluster-feeding prior to bedtime, and I’ve tried giving him both the bottle and breast at bedtime to top him off. Neither seems to make a difference.</p>\r\n<p>Since he was six weeks old I’ve implemented a consistent bedtime routine to try to “send him a message”. It seems to work–he’ll fall asleep with no problem–he just won’t stay asleep and won’t put himself back to sleep.</p>\r\n<p>People have suggested that perhaps he has silent reflux (I highly doubt it–maalox after feedings didn’t make any difference to his sleep). When he is well-rested he is very happy and agreeable. His only problem is that he has 45 minute sleep cycles that have taken over our lives in the most negative way!!</p>\r\n<p>\r\n<hr>\r\n<strong>Answer:</strong></p>\r\n<p>Its hard when you have a baby that only cat naps.  I would suggest that you check out some of <a href=\"https://www.babyhelp.co.nz/tools-tutorials/\" title=\"Tools &amp; Tutorials\">my videos</a> and see the movement I suggest for helping a baby to find their sleep. </p>\r\n<p>What we must remember is that babies do not have the tools within themselves to self soothe (self settle) or resettle until between the ages of 12 to 16 weeks so what we are trying to do in the first weeks of a babies life is to help teach them to find their sleep and to stay asleep.   This means that if our baby doesn’t fall asleep then we need to intervene to help them.   My main advice is never to do something in arms that you cannot replicate in a cot.  For you I would suggest that you do ten days of nurturing within arms and then once you understand your sons sleeping patterns then you can start to do it in the cot.  As he is your third baby and you are in the states I am not sure whether you have support within the home with helpers, if you don’t then you will probably find that you need to do at least one or two naps as concrete (these can be in arms) and the other naps can be moving naps either in a buggy or the baby worn on you. </p>\r\n<p>It will take TACT  –  time, acceptance, consistency and touch.  It takes a minimum of ten days to see a dim light at the end of the tunnel and the first 3 to 4 days are the hardest. </p>\r\n<p>At 12 weeks ideally his wake times are around 1 hour and he is having naps of a minimum of 1 hour.  IF he wake before this then you need to resettle.<br>\r\nHis wake time routine will be that he feeds, plays and then top up 15 minutes before going down for a nap.  The reason why I suggest this is for a couple of reasons it will help with increasing your milk supply (unless you do the top up with bottles) and also ensures he has a full tummy before going to have a nap.  The gastic emptying of a breast-fed baby after 120 minutes is 16% to 18%, so when you are trying to put her down for naps he may be hungry.  This will not cause a feed/sleep association as long as you feed, then swaddle/sleeping bag, then into his bed.  Also, you need to be aware that he doesn’t fall asleep while feeding unless you choose to do this.<br>\r\nAlso some babies cat nap or find it hard to fall asleep as they are light sensitive</p>\r\n<p>Have a look at your baby’s room – is it dark or is there lots of light?  To see if your baby is light sensitive, black out the windows and all the little lights on all the electrical equipment in their room and see if this helps.  It does not mean your baby will not sleep elsewhere as at this stage it is about encouraging your baby to go to sleep and stay asleep. </p>\r\n<p><strong>Settling and resettling notes over 12 weeks </strong><br>\r\nSleep is a learned behaviour.  Sleep is also a nutrient and walks hand in hand with food.  It is healthy for a baby to cry/grizzle before going to sleep.  When you go to bed you read a book, meditate, watch TV, or chat with your partner a baby can only do one thing and that is cry.  You are not leaving him there to cry it out; you are leaving him there to give him the ability to find his own sleep.  In my experience it takes approximately 20 minutes for a baby to fall asleep, however you are not going to leave your baby to do this on their own.  Ideally, you will put your baby in their cot awake, close the curtains and leave the room.  You will leave your baby for an appropriate time and then intervene with reassurance – I tend to do this in 5 minute intervals so the settling routine will look like this.  It also depends on the age of the baby.  For babies under 12 weeks, I tend to do the settling in arms.  IF doing in arms I never do any movement that cannot be replicated in a cot. into bed, leave for up to 5 minutes (at your baby’s age you will probably only leave for a minute.  Also check the crying/grizzling and whether it is off or on)<br>\r\ncomfort – reassure (this is normally less than the grizzling time)<br>\r\nthis can be repeated for up to 20 minutes with reassurance up to every five minutes (however it will be approximately the same length of time as the first time you left him or shorter NOT longer).  You then need to stay in the room and help your baby find their sleep – if you already haven’t.  Sometimes babies will not be able to go to sleep if they are light sensitive.  I would suggest that you look at your baby’s room and if they are unable to fall asleep then try making the room darker.<br>\r\nIt is not about leaving your baby to cry it out, but it is about allowing your baby the right and ability to find their sleep.  If they cannot do this in an appropriate time then intervene and help them to find their sleep. </p>\r\n<p><strong>Resettling</strong><br>\r\nTeaches babies how to progress from light to heavy sleep.  This is essential to avoid the pitfalls of frequent waking and catnapping.  In a sense, resettling is the second stage of teaching baby how to find sleep and does demand more time and patience than settling (TACT).<br>\r\nMost babies stir or wake when progressing from light to heavy sleep and this occurs anywhere between 20-45 minutes.  In the beginning the idea is not to let your baby wake fully during this transition; a sleepy baby is easier to resettle than a wide-awake, crying baby.<br>\r\nResettling is not about calming them down or staying until they just start to drift off, it is about staying with your baby until they go into a deep sleep.</p>\r\n<p>Kind Regards<br>\r\nDorothy</p>\r\n<p>If you feel you need additional support I am available to provide you with the support you need, pricing is available on <a href=\"https://www.babyhelp.co.nz/services/\" title=\"Services: Packages to suit your family\">my Services page</a> and a range of different packages to suit your needs   </p>\r\n  		</div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"panel panel-default\">\r\n            <div class=\"panel-heading\" role=\"tab\" id=\"headingTwo\">\r\n                <h4 class=\"panel-title\">\r\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\r\n                        <i class=\"more-less glyphicon glyphicon-plus\"></i>\r\n                        14 month old who frequently wakes through the night\r\n                    </a>\r\n                </h4>\r\n            </div>\r\n            <div id=\"collapseTwo\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingTwo\">\r\n                <div class=\"panel-body\">\r\n                   <div class=\"postclass pageclass clearfix entry-content\">\r\n<p><strong>Question:</strong></p>\r\n<p>I’m wondering if you can give me some advice.  My baby is 14\r\n months old and waking frequently through the night.  She has slept right\r\n through the night maybe 5 times in her entire life.  On a good night she\r\n will wake twice on a bad night she will wake every two hours.  Each time she\r\n wakes I get her up, breast feed her and then she goes straight back to bed.\r\n She’s up for about 15-20 mins each time.  I’m pregnant and feeling exhausted\r\n and wondering if there is anything I can do to encourage her to sleep all\r\n night? I would really rather not leave her to cry and I am hoping you have\r\n some advice for me on how to get her to settle herself back to sleep.</p>\r\n<p><strong>Answer:</strong></p>\r\n<p>Its hard to answer this question as I am not sure when she feeds or what she eats.  So I will give you a general guideline to work with. I am not sure whether you breast when she first wakes or she has breakfast first. I would suggest that she has breakfast then breast.  Also she has a very early nap and again I would move this over the next few weeks by 15 minute stretches until she is having lunch then nap. Until you take the time to resettle over night then you cant expect her to stop feeding.   It is healthy for a baby to cry, however it is not healthy to leave them crying for long periods of time and also not to intervene and help them find their sleep. You can replace the feeding with slight movement like cupping which can be done in arms or in the cot</p>\r\n<p>Her routine will look similar to this<br>\r\n 7.00am Breakfast solids then breast<br>\r\n 10.00am Morning tea – you can either offer a small healthy snack with water OR full breast feed<br>\r\n 12.00pm Lunch age appropriate meal  with water in sippy cup<br>\r\n 12.30pm Nap after lunch – can have breast before nap if you like<br>\r\n Nap ideally is a minimum of 1 1/2 hours can be longer optional to offer afternoon tea when she wakes – again should be a healthy snack and small and ideally no later than 3.00pm<br>\r\n 5.00pm Dinner solids<br>\r\n evening routine milk, bath, milk<br>\r\n 7.00pm bed for the night<br>\r\n Night waking resettle resettle.</p>\r\n<p><strong>SETTLING AND RESETTLING NOTES</strong><br>\r\n Settling and resettling take TACT – time, acceptance, consistency and tranquility<br>\r\n Sleep is a learned behaviour.  Sleep is also a nutrient and walks hand in hand with food.<br>\r\n It takes a minimum of ten days to see any changes and the change at the end of the light is just a dim light.  The first 3 to 4 days is always the hardest and to change their circadian sleep cycles it takes a minimum of six weeks</p>\r\n<p>Sleep is a learned behaviour.  Sleep is also a nutrient and walks hand in hand with food.  It is healthy for a baby to cry/grizzle before going to sleep. When you go to bed you read a book, meditate, watch TV, or chat with your partner – a baby can only do one thing and that is cry.  You are not leaving him there to cry it out; you are leaving him there to give him the ability to find his own sleep. In my experience it takes approximately 20 minutes for a baby to fall asleep, however you are not going to leave your baby to do this on their  own. Ideally you will put your baby  in their cot awake, close the curtains and leave the room.  You will leave your baby  for an appropriate time and then intervene with reassurance – I tend to do this in 5 minute intervals so the settling routine will look like this – and it also depends on the age of the baby.  For babies under 12 weeks, I tend to do the settling in arms.   IF doing in arms I never do any movement that cannot be replicated in a cot.</p>\r\n<p>Into bed, leave for up to 5 minutes (at your baby’s  age you will probably only leave for a minute and its also about the crying/grizzling and whether it is off or on)<br>\r\n comfort – reassure (this is normally less that the grizzling time)<br>\r\n this can be repeated for up to 20 minutes with reassurance  every five minutes and then you need to stay in the room and help your baby  find their sleep – if you already haven’t.  Sometimes babies will not be able to go to sleep if they are light sensitive.  I would suggest that you look at your baby’s room and if they are  unable to fall asleep then try making the room darker.</p>\r\n<p>It is not about leaving your baby to cry it out, but it is about allowing your baby the right and ability to find their sleep and if they cannot do this in an appropriate time then intervening and helping them to find their sleep.</p>\r\n<p>RESETTLING<br>\r\n teaches babies how to progress from light to heavy sleep. This is essential to avoid the pitfalls of frequent waking and catnapping. In a sense, resettling is the second stage of teaching baby how to find sleep and does demand more time and patience than settling (TACT).</p>\r\n<p>Most babies stir or wake when progressing from light to heavy sleep and this occurs anywhere between 20-45 minutes. In the beginning the idea is not to let your baby wake fully during this transition; a sleepy baby is easier to resettle than a wide-awake, crying baby.</p>\r\n<p>Resettling is not about calming them down or staying until they just start to drift off, it is about staying with your baby until they go into a deep sleep.<br>\r\n Thank you so much for your question I hope this helps, just remember you are doing an amazing job and being a Mother is the hardest job in the world.<br>\r\n Kind Regards<br>\r\n Dorothy</p>\r\n<p> If you feel you need additional support I am available to provide you with the support you need, pricing is available on <a href=\"https://www.babyhelp.co.nz/services/\" title=\"Services: Packages to suit your family\">my Services page</a> and a range of different packages to suit your needs  </p>\r\n  		</div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"panel panel-default\">\r\n            <div class=\"panel-heading\" role=\"tab\" id=\"headingThree\">\r\n                <h4 class=\"panel-title\">\r\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapseThree\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\r\n                        <i class=\"more-less glyphicon glyphicon-plus\"></i>\r\n                        How do I get my baby to fall asleep on her own without having to nurse her to sleep every time?\r\n                    </a>\r\n                </h4>\r\n            </div>\r\n            <div id=\"collapseThree\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree\">\r\n                <div class=\"panel-body\">\r\n                    <div class=\"postclass pageclass clearfix entry-content\">\r\n<p><strong>Question:</strong></p>\r\n<p>My little one is 17 weeks and I guess my first issue is that she loves nursing to sleep. I’m okay with her doing it for the last feed at night, but it would be great if during the day she was able to sleep on her own, because I usually find that once she falls asleep I cannot move her to her bed, so her days naps are usually lasting only a half hour because I just can’t sit there for that long and eventually have to put her down, thus waking her up. And I haven’t been consistent in swaddling her during the day, as we use the love to dream swaddles at night, but I wrap her every now and then.</p>\r\n<p>I’ve tried to ‘put out’ by not nursing her, I know she’s not hungry but comfort nursing. She won’t take the dummy and there’s no one to pass her to during the day, so I just give in! And I get really sore nipples because she seems to constantly on  them. It just seems easier to give her what she wants cause I’m usually tired and in need of a nap as well!</p>\r\n<p>Her “routine” kind of goes like this:</p>\r\n<p>At night, we usually do start winding down around 6pm, so i give her a feed, then it’s bath time then quiet time and back on the boob to go to bed. She’s been going down really well once I get her off the boob, but lately she’s been waking up at 11pm, so I feed her and pop her back in bed, then it’s up at 1-2am and then at 5.30 or so and I can usually get her back down until 7.30. When she wakes up at night, I feed her and she falls asleep and we don’t chat or move her from the bedroom or anything. I was thinking of doing a dream feed at 10.30 or so? to carry her through to 2am. Oh and we are using the love to dream swaddles at night.</p>\r\n<p>Once we’re up for the day, it’s a feed and then play and then when I know she’s tired, I’ll try to put her to sleep by swaying and ssshhing and patting before eventually nursing. so another sleep mid morning, then midday and then around 3-4pm.</p>\r\n<p>With her baths we are not bathing daily, every second day – should I incorporate this every day as part of her nighttime routine? And should I set a daytime routine up so she knows it’s sleep time?</p>\r\n<p>my partner tends to try and put her to sleep in the lounge so the TVs going and I think that’s overstimulating her, when she was younger we could do that cause she would fall asleep easily, but now I know she needs the quiet to go to sleep.</p>\r\n<p>Okay so in summary:</p>\r\n<p>How do I get her to sleep better and settle her down easier during the day without comfort nursing?</p>\r\n<p>How do we get her to sleep a decent stretch at night? – Do we need to have a dream feed?</p>\r\n<p>How can I put her down without waking her??</p>\r\n<p>Thanks in advance for your help!!</p>\r\n<p>\r\n<hr>\r\n<strong>Answer:</strong></p>\r\n<p>To teach her to self settle and to resettle then you would need to stop feeding to sleep.  However instead of feeding to sleep you can teach her how to self settle and resettle in arms.  </p>\r\n<p>Yes, I bath my baby’s every day as this creates consistency in the evening routine</p>\r\n<p>Bedrooms are for sleeping, however if you are struggling to put her to sleep in her cot and your partner is happy to do it in the lounge, I tend to cover the baby with a muslin and help close her down this way</p>\r\n<p>Dream feeds do not create or encourage babies to sleep longer at night.  IN my experience they can actually increase the night wakings so I would stay away from introducing  a dream feed. </p>\r\n<p>I tend to put a baby awake in their cots and then start self settling from there.  If I need to pick them up and settle in arms I do, however they slowly learn that they go into their cots to sleep. </p>\r\n<p>At 17 weeks her wake times will be approx 2 hours stretching to 3 hours by the time she is six months old</p>\r\n<p>She will be having naps of a minimum of 1 1/2 hours and resettling if she wakes before this.</p>\r\n<p>Her wake time will look like this</p>\r\n<p>wakes, feeds, plays, top up, then daytime sleep.</p>\r\n<p> DREAM FEEDS<br>\r\n In my experience dream feeds are controversial and need to be carefully considered before incorporating them into a feeding schedule.</p>\r\n<p> They differ from night feeds in that they are parent-led – the choice of the parent and not the baby.</p>\r\n<p> Dream feeds are given between 10pm and midnight and involve feeding a sleeping baby as opposed to one that wakes naturally. They are supposed to lengthen a baby’s sleep cycle to give a tired parent a reprieve. However, there is no evidence to indicate that dream feeds guarantee parents’ extended sleep.</p>\r\n<p> Research shows that dream feeds are thought to interfere with a baby’s most precious and deepest phase of sleep that occurs between 9pm and midnight.</p>\r\n<p> Make sure you are well informed before making your own decision, as once in place dream feeds can be difficult and disruptive to eliminate from your baby’s routine. If you do decide to include them, ideally aim to drop them by the age of six months.</p>\r\n<p> Neuroscientists believe that deliberately feeding a sleeping baby meddles with digestion, growth and development and can disrupt long-term sleeping patterns. </p>\r\n<p> GASTRIC EMPTYING<br>\r\n The gastric emptying of a breast fed baby after 120 minutes is 16 to 18% so when you are trying to put her down for naps she may be hungry.   This will not cause a feed/sleep association as long as you feed, then swaddle/sleeping bag then into her bed.   Also you need to be aware that she doesn’t fall asleep while feeding unless you choose to do this.</p>\r\n<p>SETTLING AND RESETTLING NOTES<br>\r\n Settling and resettling take TACT – time, acceptance, consistency and tranquility</p>\r\n<p> Sleep is a learned behaviour.  Sleep is also a nutrient and walks hand in hand with food.</p>\r\n<p> It takes a minimum of ten days to see any changes and the change at the end of the light is just a dim light.  The first 3 to 4 days is always the hardest and to change their circadian sleep cycles it takes a minimum of six weeks</p>\r\n<p> Sleep is a learned behaviour.  Sleep is also a nutrient and walks hand in hand with food.  It is healthy for a baby to cry/grizzle before going to sleep.   When you go to bed you read a book, meditate, watch TV, or chat with your partner – a baby can only do one thing and that is cry.  You are not leaving him there to cry it out; you are leaving him there to give him the ability to find his own sleep. In my experience it takes approximately 20 minutes for a baby to fall asleep, however you are not going to leave your baby to do this on their  own.   Ideally you will put your baby  in their cot awake, close the curtains and leave the room.  YOu will leave your baby  for an appropriate time and then intervene with reassurance – I tend to do this in 5 minute intervals so the settling routine will look like this – and it also depends on the age of the baby.  For babies under 12 weeks, I tend to do the settling in arms.   IF doing in arms I never do any movement that cannot be replicated in a cot.<br>\r\n into bed, leave for up to 5 minutes (at her age you will probably only leave for a minute and its also about the crying/grizzling and whether it is off or on)<br>\r\n comfort – reassure (this is normally less that the grizzling time)<br>\r\n this can be repeated for up to 20 minutes and then you need to stay in the room and help your baby  find their  sleep – if you already haven’t.  SOmetimes babies will not be able to go to sleep if they are light sensitive.  I would suggest that you look at your baby’s room and if they are  unable to fall asleep then try making the room darker.   </p>\r\n<p> FEEDING TO SLEEP<br>\r\n To avoid him feeding to sleep then I would suggest taking small steps.   </p>\r\n<p> To teach your baby  to self settle and resettle then you need to be able to give them the tools to do this.  I would suggest that you do this in stages so that you are pushing the boundaries a little but no so far that it is not feasible.<br>\r\n Step 1<br>\r\n Feed to nearly asleep, then remove nipple from mouth and press upwards under their chin with your finger or thumb  – they will actually keep sucking using their  tongue.  Once your baby is  asleep then transfer<br>\r\n  Step 2<br>\r\n Feed to drowsy repeat above and then hold to sleep – no rocking or movement that cannot be done in a cot<br>\r\n  Step 3<br>\r\n Feed, sleeping bag and hold to sleep<br>\r\n  Step 4<br>\r\n Feed, sleeping bag and hold to drowsy and then into cot and stay with your baby until they are   asleep.<br>\r\n With each of the above steps I would be working on a minimum of 10 days, but depending on how they respond.<br>\r\n You are going to be basically replacing the feeding with holding, cupping or a form of movement that can be replicated in the cot.<br>\r\n Thank you so much for your question I hope this helps, just remember you are doing an amazing job and being a Mother is the hardest job in the world.</p>\r\n<p> Kind Regards<br>\r\n Dorothy </p>\r\n<p> If you feel you need additional support I am available to provide you with the support you need, pricing is available on <a href=\"https://www.babyhelp.co.nz/services/\" title=\"Services: Packages to suit your family\">my Services page</a> and a range of different packages to suit your needs  </p>\r\n  		</div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        \r\n        \r\n        <div class=\"panel panel-default\">\r\n            <div class=\"panel-heading\" role=\"tab\" id=\"headingfour\">\r\n                <h4 class=\"panel-title\">\r\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapsefour\" aria-expanded=\"false\" aria-controls=\"collapsefour\">\r\n                        <i class=\"more-less glyphicon glyphicon-plus\"></i>\r\n                        How do I bring my babies sleep time forward?\r\n                    </a>\r\n                </h4>\r\n            </div>\r\n            <div id=\"collapsefour\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree\">\r\n                <div class=\"panel-body\">\r\n                    <div class=\"postclass pageclass clearfix entry-content\">\r\n<p><strong>Question:</strong></p>\r\n<p>I was wondering if you would be able to help me with bringing my daughters bedtime forward please <img draggable=\"false\" class=\"emoji\" alt=\"\" src=\"https://s.w.org/images/core/emoji/2.3/svg/1f642.svg\"></p>\r\n<p>She wakes between 9-10am most days. And will go back to sleep around 11am and will sleep for 1.5-2hrs and then back down for another nap at around 3pm and usually wakes around 4:30-5pm. I then feed her, dinner, bath and to bed by about 8pm but she will wake at about 9 and be wide awake and won’t settle again until about 10:30-11pm</p>\r\n<p>She then wakes at 1am and then 6-7am and I try keep her up then but she wants to go back to sleep</p>\r\n<p>She is 7 months old and I don’t have any problem with how she settles to sleep.</p>\r\n\r\n<hr>\r\n<p><strong>Answer:</strong></p>\r\n<p>The way to change her night time routine is to adjust her waking time in the mornings.  Although she wakes between 6 and 7.00am you are putting her back to sleep, so you can either encourage her to stay awake or give her a quick band aid nap and wake by 7.30am in the morning.  I have written a guideline for you to try and as she is 7 months i have written it for 8 months so you can either change the food/milk around or leave as it.  If you change it around then you need to change when she turns 8 months.</p>\r\n<p>Wakes and feeds and has a quick bandaid nap no longer than 30 minutes</p>\r\n<p>7.00am Wakes</p>\r\n<p>7.30 am Breakfast – cereal, toast, slice of fruit and sippy cup milk</p>\r\n<p>Offer remainder of milk when she leaves the highchair</p>\r\n<p>10.00am Morning tea – offer full milk feed</p>\r\n<p>10.45am Nap – minimum 1 1/2 hours resettle if she wakes before this</p>\r\n<p>12.15pm Wakes</p>\r\n<p>12.45pm Lunch – vegetables and carb – offer finger food to teach texture, taste and smell – ideally the finger food is what is in the puree or mash</p>\r\n<p>OFfer water in sippy cup</p>\r\n<p>3.15pm Afternoon tea offer full milk feed</p>\r\n<p>3.30pm Nap as above</p>\r\n<p>5.00pm Wakes </p>\r\n<p>5.30pm Dinner vegetables and good carb  plus finger food (this meal ideally is different to her lunchtime one).  Offer milk in sippy cup and remainder when she leaves the highchair</p>\r\n<p>Evening routine, bath, milk, clean teeth, </p>\r\n<p>8.00pm Bed for the night</p>\r\n<p>Night waking, resettle resettle, if feeding ensure you are feeding for hunger and not comfort</p>\r\n<p>SETTLING AND RESETTLING NOTES<br>\r\n Settling and resettling take TACT – time, acceptance, consistency and tranquility</p>\r\n<p> Sleep is a learned behaviour.  Sleep is also a nutrient and walks hand in hand with food.</p>\r\n<p> It takes a minimum of ten days to see any changes and the change at the end of the light is just a dim light.  The first 3 to 4 days is always the hardest and to change their circadian sleep cycles it takes a minimum of six weeks</p>\r\n<p> Sleep is a learned behaviour.  Sleep is also a nutrient and walks hand in hand with food.  It is healthy for a baby to cry/grizzle before going to sleep.   When you go to bed you read a book, meditate, watch TV, or chat with your partner – a baby can only do one thing and that is cry.  You are not leaving him there to cry it out; you are leaving him there to give him the ability to find his own sleep. In my experience it takes approximately 20 minutes for a baby to fall asleep, however you are not going to leave your baby to do this on their  own.  Ideally you will put your baby  in their cot awake, close the curtains and leave the room.  You will leave your baby  for an appropriate time and then intervene with reassurance – I tend to do this in 5 minute intervals so the settling routine will look like this – and it also depends on the age of the baby.  For babies under 12 weeks, I tend to do the settling in arms.   If doing in arms I never do any movement that cannot be replicated in a cot.<br>\r\n into bed, leave for up to 5 minutes (at her age you will probably only leave for a minute and its also about the crying/grizzling and whether it is off or on)<br>\r\n comfort – reassure (this is normally less that the grizzling time)<br>\r\n this can be repeated for up to 20 minutes and then you need to stay in the room and help your baby  find their  sleep – if you already haven’t.  Sometimes babies will not be able to go to sleep if they are light sensitive.  I would suggest that you look at your baby’s room and if they are  unable to fall asleep then try making the room darker.   </p>\r\n<p>Thank you so much for your question I hope this helps, just remember you are doing an amazing job and being a Mother is the hardest job in the world.</p>\r\n<p> Kind Regards<br>\r\n Dorothy</p>\r\n<p> If you feel you need additional support I am available to provide you with the support you need, pricing is available on <a href=\"https://www.babyhelp.co.nz/services/\" title=\"Services: Packages to suit your family\">my Services page</a> and a range of different packages to suit your needs  </p>\r\n  		</div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        \r\n        \r\n        <div class=\"panel panel-default\">\r\n            <div class=\"panel-heading\" role=\"tab\" id=\"headingfive\">\r\n                <h4 class=\"panel-title\">\r\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapsefive\" aria-expanded=\"false\" aria-controls=\"collapsefive\">\r\n                        <i class=\"more-less glyphicon glyphicon-plus\"></i>\r\n                        Help - my 4 1/2 month old is a chronic catnapper!\r\n                    </a>\r\n                </h4>\r\n            </div>\r\n            <div id=\"collapsefive\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree\">\r\n                <div class=\"panel-body\">\r\n                    <div class=\"postclass pageclass clearfix entry-content\">\r\n<p><strong>Question:</strong></p>\r\n<p>I have a 4.5 month old boy, who is a chronic catnapper!</p>\r\n<p>I can set my watch and he will wake up exactly 42 minutes after he’s gone down during the day! Which as I’m sure you’ve heard before is quite frustrating!</p>\r\n<p>We have quite a good Eat/play/sleep routine but it really gets out of whack when the sleeping isn’t for longer than 45minutes. He is EBF and has 6 feeds a day (dreamfeed at 10:30pm) and he will usually wake once in the night ranging from 3:30-6:00am. He’s slept through to 7am twice and that was just last week.</p>\r\n<p>We attempt naps at 9, 1 and 4 – but it’s a bit of challenge as we live rurally so to go anywhere is at least a 20 minute drive and sometimes it just doesn’t fit with what we have on that day.</p>\r\n<p>He was born at 3.12kg and when I popped him on the scales last week he was over 7.5kg with clothes on. So no issues there!</p>\r\n<p>We used to use a miracle blanket, but transitioned to a merino sleeping bag for day and night sleeps and it didn’t change anything, as the catnapping has been around for a while… He used to take a dummy and would sometimes resettle with that, but now he spits it out or pulls it out with his hand (and laughs)! So we haven’t tried that for a month or so.</p>\r\n<p>We have white noise going and a good nap time routine, nappy change, sleeping bag, story and cuddle – he self settles usually in a few minutes and has been self soothing by thumb sucking.</p>\r\n<p>When he wakes up at the 42min mark, on the odd occasion (once or twice a week) he will self sooth and go another sleep cycle, but it’s not that often.</p>\r\n<p>Wondering what else we can do to get the day sleeps more consistent.</p>\r\n<p>He is usually in bed asleep by 6:30pm and will wake up between 7-7:45am. With one wake up if half an hour for feed and resettle.</p>\r\n<p>He usually wakes up at the 42min mark grunting and grizzling and cries out, I usually wait at least 10<br>\r\n minutes before I go in, but as soon as he sees me then he’s happy as and doesn’t seem tired after his quick nap.</p>\r\n<p>\r\n<hr>\r\n<strong>Answer:</strong></p>\r\n<p>Ideally his wake times for a 4.5 month are around 2 to 2 1/4 stretching out to 3 hours by the time he is six months old. Nap times he will be having around  3 naps a day with a  minimum 1 1/2 hours OR he will be having 2 naps with a minimum of 1 1/2 hours and 1 band aid nap of less than 30 minutes to get through to the evening routine .</p>\r\n<p>His wake time routine will be he wakes, feeds, plays, gets offered a top up feed, then sleeping bag and then down for a nap.</p>\r\n<p>GASTRIC EMPTYING<br>\r\n The gastric emptying of a breast fed baby after 120 minutes is 16 to 18% so when you are trying to put him down for naps he may be hungry.  This will not cause a feed/sleep association as long as you feed, then swaddle/sleeping bag then into his bed.  Also you need to be aware that he doesn’t fall asleep while feeding unless you choose to do this.</p>\r\n<p> SETTLING AND RESETTLING NOTES<br>\r\n Settling and resettling take TACT – time, acceptance, consistency and tranquility<br>\r\n  Sleep is a learned behaviour.  Sleep is also a nutrient and walks hand in hand with food.<br>\r\n  It takes a minimum of ten days to see any changes and the change at the end of the light is just a dim light.  The first 3 to 4 days is always the hardest and to change their circadian sleep cycles it takes a minimum of six weeks.</p>\r\n<p> When you go to bed you read a book, meditate, watch TV, or chat with your partner – a baby can only do one thing and that is cry. There is nothing unhealthy about a baby crying before going to sleep. As a parent, it can be difficult to listen to but as long your baby is happy and contented generally, crying is just part of life. Remember you are not leaving him there to cry it out; you are leaving him there to give him the ability to find his own sleep.</p>\r\n<p>You will not get anywhere by leaving your baby to cry for hours.  You will succeed quicker by giving him space and then helping him find his sleep.</p>\r\n<p>Dream feeds<br>\r\n In my experience dream feeds are controversial and need to be carefully considered before incorporating them into a feeding schedule.</p>\r\n<p> Dream feeds are given between 10pm and midnight and involve feeding a sleeping baby as opposed to one that wakes naturally. They are supposed to lengthen a baby’s sleep cycle to give a tired parent a reprieve. However, there is no evidence to indicate that dream feeds guarantee parents’ extended sleep.</p>\r\n<p> Research shows that dream feeds are thought to interfere with a baby’s most precious and deepest phase of sleep that occurs between 9pm and midnight.</p>\r\n<p> Make sure you are well informed before making your own decision, as once in place dream feeds can be difficult and disruptive to eliminate from your baby’s routine. If you do decide to include them, ideally aim to drop them by the age of six months.</p>\r\n<p> Neuroscientists believe that deliberately feeding a sleeping baby meddles with digestion, growth and development and can disrupt long-term sleeping patterns.</p>\r\n<p>These include white noise, music, movement, night-lights and dummies.</p>\r\n<p> In my experience, props will tend to interfere with your baby’s  ability to self-settle and re settle  </p>\r\n<p> It is very difficult to sleep train a baby that uses props for going to sleep. My advice is to take away all the props and start afresh. So, that means no rocking, no dummies (not in the first instance but certainly later if your baby is struggling to settle) and no white noise (unless you and your partner have white noise to sleep with). </p>\r\n<p> The more props that you introduce into your baby’s routine the more complicated you are making your life as your baby grows.</p>\r\n<p> The best way to get a fast-forward  idea of how restricted life may become is to imagine that you are travelling with your baby .  Visualize that when you are in the middle of a plane, train or bus and it is your baby’s nap or sleep time that you need to provide him with all his props to help him sleep. Whilst you may be able to provide some of the props other are not so easy – you cannot replace a baby’s white noise with a substitute, as they will be looking for their ‘white’ noise.</p>\r\n<p>Thank you so much for your question I hope this helps, just remember you are doing an amazing job and being a Mother is the hardest job in the world.</p>\r\n<p> Kind Regards<br>\r\n Dorothy</p>\r\n<p> If you feel you need additional support I am available to provide you with the support you need, pricing is available on <a href=\"https://www.babyhelp.co.nz/services/\" title=\"Services: Packages to suit your family\">my Services page</a> and a range of different packages to suit your needs   </p>\r\n  		</div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        \r\n        <div class=\"panel panel-default\">\r\n            <div class=\"panel-heading\" role=\"tab\" id=\"headingsix\">\r\n                <h4 class=\"panel-title\">\r\n                    <a class=\"collapsed\" role=\"button\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapsesix\" aria-expanded=\"false\" aria-controls=\"collapsefive\">\r\n                        <i class=\"more-less glyphicon glyphicon-plus\"></i>\r\n                        How can I get my 4 month old to self settle without a dummy ?\r\n                    </a>\r\n                </h4>\r\n            </div>\r\n            <div id=\"collapsesix\" class=\"panel-collapse collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree\">\r\n                <div class=\"panel-body\">\r\n                    <div class=\"postclass pageclass clearfix entry-content\">\r\n<p><strong>Question:</strong></p>\r\n<p>My four month old has a great routine –<br>\r\n7.00am wake<br>\r\n7.00am bottle (formula)<br>\r\n8.00am solids (farex, apple puree etc)<br>\r\n9.00-11.00am Sleep<br>\r\n11.00am bottle<br>\r\n12.00pm solids<br>\r\n1.00-3.00pm sleep<br>\r\n3.00pm bottle<br>\r\n4.30-5.15pm nap<br>\r\n5.20pm solids<br>\r\n5.45pm bath<br>\r\n6.00-6.30pm bottle<br>\r\n7pm bed<br>\r\n10.30pm dream feed</p>\r\n<p>Generally my baby wakes once per night for a feed (last night was 5.30am) and put my baby back to bed where she slept until 7.30am when she woke.</p>\r\n<p><strong>My challenge is her waking when her falls out dummy when she hits the 45 minute sleep cycle.</strong><br>\r\nShe crys out and is moving her head / mouth looking for her dummy. How do I get rid of the dummy or make the dummy work better for her?<br>\r\nDuring the night, she can self settle, it is mostly during the day that she gets frustrated.</p>\r\n<p>\r\n<hr>\r\n<strong>Answer:</strong></p>\r\n<p>With regard to her dummy it is about not using it as a prop but as a settling tool. This means that when she goes to bed she goes down without her dummy and you allow her an appropriate time to settle and then if she doesn’t settle then intervene with your settling tools to help her find her sleep. I have also adjusted her routine for you.</p>\r\n<p>7.00am Wake<br>\r\n7.15am Bottle and Solids </p>\r\n<p>Offer milk feed before naptime<br>\r\n9.00 -11.00 am sleep</p>\r\n<p>11.15am Solids plus water in Sippy cup<br>\r\n12.45pm Milk feed<br>\r\n1.00pm Nap<br>\r\n3.00pm Wakes<br>\r\n3.15pm Milk feed</p>\r\n<p>In between here I would suggest you do a band-aid nap so work backwards from her going to bedtime and keep her wake time the same. So at this stage I would suggest the band-aid nap be 5 to 5.30pm and then bed by 7.30pm. If you cant do the band aid nap then stretch her wake times out to 2 hours 15 minutes and then her bed time would be around the time you want. </p>\r\n<p>5.00pm Band-aid nap no longer than 30 minutes<br>\r\n5.30pm Wakes<br>\r\n5.15pm Solids and milk<br>\r\nEvening routine bath, milk</p>\r\n<p>7.30 bed<br>\r\nIf feeding during the night ensure you are feeding for hunger and not comfort. </p>\r\n<p>Dummies are a useful tool to help settle your baby if they need help to find their sleep. However if you ‘plug’ your baby with the dummy as soon as they go to bed then, I believe, that you are taking away their chance and ability to try and settle by themselves.<br>\r\nGiving a dummy to your baby straight away can in fact cause more crying than if you let them grizzle/cry first before allowing, and then if needed, use as part of your settling tools. .</p>\r\n<p>Dummies are designed to comfort newborn babies. Around six months most babies no longer need to ‘suck’ to gain comfort and so the use of a dummy should diminish.</p>\r\n<p>However, if your baby continues to use the dummy as a comforter it is important to keep it for their cot, for settling and re-settling. It should not be given so that your baby has it in their mouth the whole time. I often see this latter approach when mums are out and about and I understand in this circumstance that the object of the dummy in an older child’s mouth is to keep them quiet. However, doing this regularly can affect their speech development.</p>\r\n<p><strong>BAND AID NAPS</strong><br>\r\nNow between this feed and going to bedtime you either need to decide whether to put her to bed for the night at 5.00pm or do a band aid nap. If you choose to do a Band-Aid nap then work backwards from 7.30pm so that she is waking from the Band-Aid no later than 5.00pm so the Band-Aid nap will be between 5.00pm and 5.30pm</p>\r\n<p><strong>SETTLING AND RESETTLING NOTES</strong><br>\r\nSettling and resettling take TACT – time, acceptance, consistency and tranquility</p>\r\n<p>Sleep is a learned behaviour. Sleep is also a nutrient and walks hand in hand with food.</p>\r\n<p>It takes a minimum of ten days to see any changes and the change at the end of the light is just a dim light. The first 3 to 4 days is always the hardest and to change their circadian sleep cycles it takes a minimum of six weeks</p>\r\n<p>Sleep is a learned behaviour. Sleep is also a nutrient and walks hand in hand with food. It is healthy for a baby to cry/grizzle before going to sleep. When you go to bed you read a book, meditate, watch TV, or chat with your partner – a baby can only do one thing and that is cry. You are not leaving him there to cry it out; you are leaving him there to give him the ability to find his own sleep. In my experience it takes approximately 20 minutes for a baby to fall asleep, however you are not going to leave your baby to do this on their own. Ideally you will put your baby in their cot awake, close the curtains and leave the room. You will leave your baby for an appropriate time and then intervene with reassurance – I tend to do this in 5-minute intervals so the settling routine will look like this – and it also depends on the age of the baby. For babies under 12 weeks, I tend to do the settling in arms. IF doing in arms I never do any movement that cannot be replicated in a cot.</p>\r\n<p>Into bed, leave for up to 5 minutes (at your baby’s age you will probably only leave for a minute and its also about the crying/grizzling and whether it is off or on)</p>\r\n<p>Comfort – reassure (this is normally less that the grizzling time)</p>\r\n<p>This can be repeated for up to 20 minutes with reassurance every five minutes and then you need to stay in the room and help your baby find their sleep – if you already haven’t. Sometimes babies will not be able to go to sleep if they are light sensitive. I would suggest that you look at your baby’s room and if they are unable to fall asleep then try making the room darker. </p>\r\n<p>It is not about leaving your baby to cry it out, but it is about allowing your baby the right and ability to find their sleep and if they cannot do this in an appropriate time then intervening and helping them to find their sleep. </p>\r\n<p><strong>RESETTLING</strong><br>\r\nTeaches babies how to progress from light to heavy sleep. This is essential to avoid the pitfalls of frequent waking and catnapping. In a sense, resettling is the second stage of teaching baby how to find sleep and does demand more time and patience than settling (TACT).</p>\r\n<p>Most babies stir or wake when progressing from light to heavy sleep and this occurs anywhere between 20-45 minutes.<br>\r\nIn the beginning the idea is not to let your baby wake fully during this transition; a sleepy baby is easier to resettle than a wide-awake, crying baby.</p>\r\n<p>Resettling is not about calming them down or staying until they just start to drift off, it is about staying with your baby until they go into a deep sleep.</p>\r\n<p><strong>DREAM FEEDS<br>\r\nDream feeds</strong><br>\r\nIn my experience dream feeds are controversial and need to be carefully considered before incorporating them into a feeding schedule.</p>\r\n<p>They differ from night feeds in that they are parent-led – the choice of the parent and not the baby.<br>\r\nDream feeds are given between 10pm and midnight and involve feeding a sleeping baby as opposed to one that wakes naturally. They are supposed to lengthen a baby’s sleep cycle to give a tired parent a reprieve. However, there is no evidence to indicate that dream feeds guarantee parents’ extended sleep.<br>\r\nResearch shows that dream feeds are thought to interfere with a baby’s most precious and deepest phase of sleep that occurs between 9pm and midnight. </p>\r\n<p>Make sure you are well informed before making your own decision, as once in place dream feeds can be difficult and disruptive to eliminate from your baby’s routine. If you do decide to include them, ideally aim to drop them by the age of six months.</p>\r\n<p><strong>Neuroscientists believe that deliberately feeding a sleeping baby meddles with digestion, growth and development and can disrupt long-term sleeping patterns. </strong></p>\r\n<p>Thank you so much for your question I hope this helps, just remember you are doing an amazing job and being a Mother is the hardest job in the world.</p>\r\n<p>Kind Regards<br>\r\nDorothy</p>\r\n<p>If you feel you need additional support I am available to provide you with the support you need, pricing is available on <a href=\"https://www.babyhelp.co.nz/services/\" title=\"Services: Packages to suit your family\">my Services page</a> and a range of different packages to suit your needs   </p>\r\n  		</div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n\r\n    </div><!-- panel-group -->\r\n    \r\n         </div>\r\n         \r\n          <div class=\"col-md-12\">\r\n<!--          <h3 class=\"third-color fa-2x\">Product Information</h3>\r\n-->          \r\n   \r\n        <p>For help on your own sleep journey, <span class=\"span third-color\" style=\"font-weight:500\">call our free hotline</span> for advice and support.</p>\r\n        <p>We also have a wide range of products to help babies sleep – from sleep sacks and swaddles to night lights and baby ‘shushers’</p>\r\n        <a href=\"#\" class=\"link third-color\"> <strong>find a sleep solution for your baby now</strong></a>\r\n\r\n\r\n         \r\n          </div>\r\n          \r\n          </div>\r\n        </div>\r\n      </div>\r\n\r\n<script>\r\n    require([\r\n        \'jquery\'\r\n    ], function ($) {\r\n        $(\"#collapseOne\").hide();\r\n        $(\"#collapseTwo\").hide();\r\n        $(\"#collapseThree\").hide();\r\n        $(\"#collapsefour\").hide();\r\n        $(\"#collapsefive\").hide();\r\n        $(\"#collapsesix\").hide();\r\n\r\n$(\"#headingOne a\").click(function(){\r\n        $(\"#collapseOne\").show();\r\n        $(\"#collapseTwo\").hide();\r\n        $(\"#collapseThree\").hide();\r\n        $(\"#collapsefour\").hide();\r\n        $(\"#collapsefive\").hide();\r\n        $(\"#collapsesix\").hide();\r\n});\r\n\r\n$(\"#headingTwo a\").click(function(){\r\n        $(\"#collapseOne\").hide();\r\n        $(\"#collapseTwo\").show();\r\n        $(\"#collapseThree\").hide();\r\n        $(\"#collapsefour\").hide();\r\n        $(\"#collapsefive\").hide();\r\n        $(\"#collapsesix\").hide();\r\n});\r\n\r\n$(\"#headingThree a\").click(function(){\r\n        $(\"#collapseOne\").hide();\r\n        $(\"#collapseTwo\").hide();\r\n        $(\"#collapseThree\").show();\r\n        $(\"#collapsefour\").hide();\r\n        $(\"#collapsefive\").hide();\r\n        $(\"#collapsesix\").hide();\r\n});\r\n\r\n$(\"#headingfour a\").click(function(){\r\n        $(\"#collapseOne\").hide();\r\n        $(\"#collapseTwo\").hide();\r\n        $(\"#collapseThree\").hide();\r\n        $(\"#collapsefour\").show();\r\n        $(\"#collapsefive\").hide();\r\n        $(\"#collapsesix\").hide();\r\n});\r\n\r\n$(\"#headingfive a\").click(function(){\r\n        $(\"#collapseOne\").hide();\r\n        $(\"#collapseTwo\").hide();\r\n        $(\"#collapseThree\").hide();\r\n        $(\"#collapsefour\").hide();\r\n        $(\"#collapsefive\").show();\r\n        $(\"#collapsesix\").hide();\r\n});\r\n\r\n$(\"#headingsix a\").click(function(){\r\n        $(\"#collapseOne\").hide();\r\n        $(\"#collapseTwo\").hide();\r\n        $(\"#collapseThree\").hide();\r\n        $(\"#collapsefour\").hide();\r\n        $(\"#collapsefive\").hide();\r\n        $(\"#collapsesix\").show();\r\n});\r\n\r\n    });\r\n</script>',	'2017-08-31 07:11:13',	'2017-09-04 11:53:49',	1,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	0),
(27,	'Car Seat Information',	'1column',	NULL,	NULL,	'car-seat-information',	NULL,	'<div class=\"col-sm-3\">{{widget type=\"Ves\\Megamenu\\Block\\Widget\\Menu\" alias=\"top-tips-cms-menu\"}}</div>\r\n\r\n    <div class=\"col-sm-9\">\r\n      <h1 class=\"display-4 base-heading\">Car Seat Information</h1>\r\n      <h3 class=\"third-color fa-2x font-light font-size-24\">Safe, secure, comfortable – choosing the right car seat</h3>\r\n      <div class=\"car-seat-Information globel-right-content\" style=\"margin-top:0\">\r\n        <div class=\"row\">\r\n          <div class=\"col-md-12\">\r\n            <p>Car seats are a baby essential. There are a huge number of car seats on the market, and you need to choose one that\r\n              fits your child, fits your car, and is easy to install and use.\r\n              Here are our car seat recommendations – if you need more help or advice, feel free to give us a call or come into the\r\n              store for a chat.</p>\r\n          </div>\r\n          <div class=\"clearfix\"></div>\r\n          <div class=\"col-md-12 topics\">\r\n            <h3 class=\"third-color fa-2x\" style=\"margin-top:0px; margin-bottom:15px;\">Our top five car seat safety tips</h3>\r\n            <ol>\r\n              <li> Buy early\r\n                <p>Buy your car seat well before you’ll need it so you can practise installing and using it.</p>\r\n              </li>\r\n              <li> Try before you buy\r\n                <p>Always try the car seat in your car before you buy – and don’t just sit it on the seat. Check that the safety belt of your\r\n                  car is long enough to secure the seat correctly. Check it in forward and rear-facing positions, and if you plan to use the\r\n                  seat in more than one car, test it out in both vehicles.</p>\r\n              </li>\r\n              <li> Install correctly\r\n                <p>Installing a car seat can be tricky, so make sure you follow the manufacturers’ instructions. If the seat is designed with\r\n                  a tether strap, make sure you use it – otherwise you’ll be compromising the safety of your seat.</br>\r\n                  If you’re unsure, Plunket will check your installation, and some retailers have staff who can help as well. An incorrectly\r\n                  installed seat will put your child at risk of serious injury or death, so it’s not something to take lightly.</p>\r\n              </li>\r\n              <li> Pick your position\r\n                <p>The safest place for a child restraint is in the back seat of a vehicle, preferably behind the passenger seat. Never place\r\n                  a rear facing restraint or capsule in the front passenger seat if the car has an airbag that can’t be disabled. In a crash,\r\n                  the airbag could throw the restraint up against the seat, seriously injuring or killing the baby.</p>\r\n              </li>\r\n              <li> Never buy a second-hand seat\r\n                <p>Second-hand car seats can seem like a good idea, but it’s not worth the risk. A second-hand seat could have been\r\n                  damaged in an accident, bought overseas so it doesn’t comply with NZ standards, or be missing essential parts.</p>\r\n                <p>Car seats usually have plastic components and webbing, which can deteriorate over time – which is why they usually\r\n                  have an expiry date. A second-hand seat could look fine, but be dangerously damaged or expired.</p>\r\n                <p>If buying a brand-new seat is out of your budget, some retailers have rental services, and Dimples has a lay-by service\r\n                  so you can pay off your seat over time..</p>\r\n              </li>\r\n              <li> Pick your position\r\n                <p>The safest place for a child restraint is in the back seat of a vehicle, preferably behind the passenger seat. Never place\r\n                  a rear facing restraint or capsule in the front passenger seat if the car has an airbag that can’t be disabled. In a crash,\r\n                  the airbag could throw the restraint up against the seat, seriously injuring or killing the baby.</p>\r\n              </li>\r\n            </ol>\r\n            <h3 class=\"third-color fa-2x\" style=\"margin-bottom:5px\">Switching seats: ages, stages, and when to change</h3>\r\n            <p>The best car seat is one that fits your child, fits into your car, and is easy to install and use.</p>\r\n            <p>It’s considered safest to buy new seats to fit your child as they grow, rather than buying one seat to fit a large weight\r\n              range. Never buy a seat that’s too big for your child.</p>\r\n            <p>Car seats are divided into categories based on the weight and height of your child – age is less important.</p>\r\n            <table>\r\n              <h4><strong>The weight/age stages are:</strong></h4>\r\n              <tr>\r\n                <td><strong>Baby: &nbsp;\r\n                  </strong></td>\r\n                <td> Birth weight - 13kg l 0-12 months</td>\r\n              </tr>\r\n              <tr>\r\n                <td><strong>Toddler: &nbsp;\r\n                  </strong></td>\r\n                <td>9-18 kg l 9 months to 3.5 years</td>\r\n              </tr>\r\n              <tr>\r\n                <td><strong>Child: &nbsp;\r\n                  </strong></td>\r\n                <td>15-36 kg l 3.5 to 12 years</td>\r\n              </tr>\r\n            </table>\r\n            <h3 class=\"third-color fa-2x\" style=\"margin-bottom:5px;\">Rear-facing rules</h3>\r\n            <p>Babies go into a rear-facing seat at first, then move into a forward facing seat when they get too tall to fit into a\r\n              rear-facing seat comfortably.</p>\r\n            <p>Babies have large heads and comparatively weak necks, which makes them particularly vulnerable in a crash.\r\n              Rear-facing seats absorb the impact of a crash so it is less damaging to your baby.</p>\r\n            <p>Wait as long as possible to switch your baby to a forward-facing position – at least up to 12 months, and longer if\r\n              they’re still comfortable in their rear-facing seat.</p>\r\n            <h3 class=\"third-color fa-2x\" style=\"margin-bottom:5px;\">Moving to a toddler seat</h3>\r\n            <p>When the tips of your baby’s ears are above the top of the seat back, it’s time to switch to a new one. Don’t worry\r\n              about their legs – they can extend beyond the edge of the seat.</p>\r\n            <h3 class=\"third-color fa-2x\" style=\"margin-bottom:5px;\">Moving to a child restraint</h3>\r\n            <p>Move your child from a toddler seat to a child seat or booster when their shoulders are 2cm above the highest\r\n              openings for the shoulder straps in their seat. Make sure the headrest of the new car seat is set to the lowest position\r\n              when you switch.</p>\r\n            <h3 class=\"third-color fa-2x\" style=\"margin-bottom:5px;\">No more car seats</h3>\r\n            <p>When your child reaches 1.5 metres in height, they no longer legally require a car seat. Of course, they still need to use\r\n              a seat belt whenever you drive.</p>\r\n            <a href=\"#\" class=\"link fa-2x\"><strong>Check out our range of Maxi-Cosi seats now.</strong></a>\r\n          </div>\r\n          <div class=\"col-md-12\">\r\n            <h3 class=\"third-color fa-2x font-light font-size-24\">Buying a car seat: handy features and safety standards</h3>\r\n            <p class=\"secondary-color\">When you’re ready to buy a car seat, be prepared to do a bit of research. You’ll want to find the best seat for your\r\n              needs – not just the first seat you see.</p>\r\n            <div class=\" topics\">\r\n              <h3 class=\" fa-2x\" style=\"font-weight:600\">These are our top four features to look for in a car seat:</h3>\r\n              <ol>\r\n                <li> Adjustable seat back\r\n                  <p>Buy your car seat well before you’ll need it so you can practise installing and using it.</p>\r\n                </li>\r\n                \r\n                <li>Side protection wings\r\n                  <p>Padded side wings will help protect your child in a side-impact crash. Side wings are often height adjustable so they can move upwards as your child grows.</p>\r\n                </li>\r\n                \r\n                \r\n               <li>Removable, washable cover<p>Make sure the lining and cover of the seat can be removed and washed easily – you’ll be surprised by how messy a car seat can get.</p></li>\r\n\r\n                <li>Sturdy, simple harness<p>Test the clips and buttons on the car seat’s harness before you buy – if they’re very difficult to open and close without a child in them, they’ll be almost impossible with a baby in the seat. Tug on the straps to make sure they clip firmly.</p></li>\r\n\r\n                <li>Padded cover<p>Some seats are very lightly padded, while others are much softer. More padding means a more comfortable ride for your child, and protection for their head as it moves around.</p></li>\r\n\r\n              </ol>\r\n            </div>\r\n            \r\n            \r\n            <h3 class=\"third-color fa-2x font-light font-size-24\" style=\"margin-bottom:5px\">Safety extras: Isofix and LATCH</h3>\r\n<p>Many late-model cars are fitted with Isofix mounting points. An Isofix-compatible restraint can be snapped into the\r\nseat frame instead of being held in place by the car’s safety belt, making it easier to install correctly. LATCH (Lower\r\nAnchors and Tethers for Children) is a similar system and will also fit the Isofix mounting points.</p>\r\n<p>Many cars have Isofix points hidden under the rear seat cushions. Try poking your hand down between the seat back\r\nand cushions, and feel for a metal loop. Each seat should have two loops.</p>\r\n<h3 class=\"third-color fa-2x font-light font-size-24\" style=\"margin-bottom:5px\">Safety Standards</h3>\r\n<p>When you buy a car seat in New Zealand, it must meet one of these safety standards. If you buy from a reputable\r\nretailer, their seats will meet one or more of the standards, but it’s good to check, just in case.</p>\r\n<p>Here’s what to look out for:</p>\r\n<table class=\"table\">\r\n	<tr><td><p><strong>Australian/NZ standard AS/NZS1754:</strong> This is identified by the Australian ‘tick’ mark.</p><img src=\"{{media url=\"wysiwyg/australian.jpg\"}}\" alt=\"\" class=\"img-responsive\"/></td></tr>\r\n    	<tr><td><p><strong>European Standard ECE R44.04:</strong> Car seats that meet this standard can be identified by a yellow label with an ‘E’ in a\r\ncircle. </br> An older version of the European standard, ECE R44.03, was replaced in 2005. There should be very few of these seats\r\nleft in New Zealand.</p><img src=\"{{media url=\"wysiwyg/european_-standard.jpg\"}}\" alt=\"\" class=\"img-responsive\" />class=\"img-responsive\"/>td></tr>\r\n\r\n<tr><td><p><strong>US standard FMVSS213:</strong> Restraints that comply with this standard must display the number FMVSS213 and carry the\r\n‘S’ mark to show they have been certified for use in New Zealand.</p><img src=\"{{media url=\"wysiwyg/us-standard.jpg\"}}\" alt=\"\" class=\"img-responsive\" /></td></tr>\r\n\r\n</table>\r\n\r\n\r\n          </div>\r\n          \r\n          \r\n          <div class=\"col-md-12 rules-and-regulations\">\r\n            <h3 class=\"third-color fa-2x font-light font-size-24\">Rules and regulations: New Zealand car seat laws </h3>\r\n            <p class=\"secondary-color\">The law in New Zealand requires children under 7 to be restrained in a car seat every time you drive. </p>\r\n             <p class=\"secondary-color\">The restraint must be an approved seat that’s appropriate for the child’s height and weight. </p>\r\n            <div class=\"topics\">\r\n              <h3 class=\" fa-2x\" style=\"font-weight:600\">These are our top four features to look for in a car seat:</h3>\r\n              <ul>\r\n                <li>Must be properly restrained in an approved child seat \r\n                </li>\r\n                \r\n                <li>They must not travel in the car without an approved restraint</p>\r\n               </ul>\r\n            </div>\r\n          \r\n          <div class=\" topics\">\r\n              <h3 class=\" fa-2x\" style=\"font-weight:600\">Children aged between 7-8</h3>\r\n              <ul>\r\n                <li>Must use a child restraint if available\r\n                </li>\r\n                \r\n                <li>If there is no child restraint available, the child must use a safety be</p>\r\n               </ul>\r\n            </div>\r\n            \r\n          <div class=\" topics\">\r\n              <h3 class=\" fa-2x\" style=\"font-weight:600\">Children aged between 8-14 </h3>\r\n              <ul>\r\n                <li>Must use a safety belt if available \r\n                </li>\r\n                \r\n                <li>If no belt is available, they must travel in the back seat </p>\r\n               </ul>\r\n            </div>  \r\n            \r\n            <div class=\" topics\">\r\n              <h3 class=\" fa-2x\" style=\"font-weight:600\">Children over 14 </h3>\r\n              <ul>\r\n                <li>Must use a safety belt if available \r\n                </li>\r\n                \r\n                <li>If no belt is available, they must travel in the back seat </p>\r\n               </ul>\r\n               <a href=\"#\" class=\"link fa-2x\"><strong>Find the right car seat for your child now.</strong></a>\r\n            </div> \r\n          \r\n          \r\n        </div>\r\n      </div>\r\n    </div>',	'2017-08-31 07:26:16',	'2017-09-04 11:26:49',	1,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	0),
