(30,	'Gift Voucher',	'1column',	NULL,	NULL,	'gift-voucher',	NULL,	'<div class=\"col-sm-3 col-xs-12\">{{widget type=\"Ves\\Megamenu\\Block\\Widget\\Menu\" alias=\"gift-cms-menu\"}}</div>	\r\n<div class=\"col-sm-9 col-xs-12\">\r\n      <div class=\"gift-vouchers globel-right-content\">\r\n        <div class=\"row\">\r\n          <div class=\"col-md-12\">\r\n            <h1 class=\"display-4 base-heading\" style=\"margin-top:0\">Beautiful gifts, useful vouchers </h1>\r\n            <p>Choose one of our gorgeous pre-packaged present sets, or give a voucher to help new parents stock up on baby essentials. Vouchers can be redeemed online or in our Newmarket boutique. </p>\r\n            <p>Find the perfect present now. </p>\r\n          </div>\r\n          <div class=\"add-to-cart-wrap\">\r\n\r\n{{widget type=\"Magento\\CatalogWidget\\Block\\Product\\ProductsList\" title=\"Products\" products_count=\"6\" template=\"product/widget/content/grid.phtml\" conditions_encoded=\"a:1:[i:1;a:4:[s:4:`type`;s:50:`Magento|CatalogWidget|Model|Rule|Condition|Combine`;s:10:`aggregator`;s:3:`all`;s:5:`value`;s:1:`1`;s:9:`new_child`;s:0:``;]]\"}}\r\n\r\n</div>\r\n          <div class=\"clearfix\"></div>\r\n        </div>\r\n      </div>\r\n    </div>',	'2017-09-02 05:37:42',	'2017-09-02 05:55:31',	1,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	0),
(31,	'Dorothy Waide - Baby Consultant',	'1column',	NULL,	NULL,	'dorothy-waide-baby-consultant',	NULL,	'<div class=\"col-sm-3 col-xs-12\">{{widget type=\"Ves\\Megamenu\\Block\\Widget\\Menu\" alias=\"top-tips-cms-menu\"}}</div>	\r\n<div class=\"col-sm-9 col-xs-12\">\r\n      <h1 class=\"display-4 base-heading\">Dorothy Waide is Dimples’ official Baby Sleep consultant. </h1>\r\n      <!-- <h3 class=\"third-color fa-2x\">Would you like some free sleep help? Email our sleep hotline -\r\nsleephelp@dimples.co.nz</h3>-->\r\n      <div class=\"delivery-returns globel-right-content\">\r\n        <div class=\"row\">\r\n          <div class=\"col-md-12\">\r\n            <p>Dorothy has been working with parents and babies for over three decades. Through her business – Baby Help – she guides and supports parents as they work through sleep problems.  </p>\r\n            <div class=\"topics\">\r\n              <h3 class=\"third-color fa-2x font-light font-size-24\">Individual solutions for individual families </h3>\r\n              <p>Working with parents and babies for three decades means Dorothy has seen sleep theories and techniques come and go. Since she began her work as a Karitane nurse and post-partum care provider, Dorothy says her personal philosophy has changed from a focus on rigid routines and cry it out, to a more nurturing approach. She now uses a flexible system, helping each baby find their own sleep rhythm and intervening when appropriate. </p>\r\n<p>As Dorothy explains: “I take the best from both sides of parenting and find a flexible and nurturing middle ground that works for mum, baby and family.” </p>\r\n<p>Because no baby is the same, Dorothy tailors her approach to suit individual babies and families. She uses her knowledge of current scientific and medical theory, along with her vast experience of real-life babies, to create sleep solutions that really work. </p>\r\n            </div>\r\n            \r\n            \r\n            <div class=\"topics\">\r\n              <h3 class=\"third-color fa-2x font-light font-size-24\">Dorothy Waide and Dimples  </h3>\r\n              <p>Dorothy is working with Dimples to offer support for parents and their babies. </p>\r\n<p>She is also setting up a series of Sleep Help parenting classes to provide parents with the tools, confidence and knowledge they need to nurture and care for their baby in the first 12 weeks. The series will cover sleep and settling, feeding, burping, bathing, and how to set up a nursery.  </p>\r\n<p>For advice, support, or to join one of our parenting classes, <a href=\"#\" class=\"link\">get in touch now.</a></p>\r\n            </div>\r\n            \r\n            <div class=\"topics\">\r\n              <h3 class=\"third-color fa-2x font-light font-size-24\">Meet Dorothy Waide</h3>\r\n              <div class=\"video mt-20\" style=\"max-width:600px;\">\r\n              <div class=\"embed-responsive embed-responsive-16by9\">\r\n              <iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/NdJ2VmTEgME?rel=0&amp;showinfo=0\" width=\"560\"></iframe>\r\n              </iframe>\r\n            </div>\r\n            \r\n            	</div>\r\n              \r\n\r\n            </div>\r\n           \r\n          </div>\r\n\r\n        </div>\r\n      </div>\r\n    </div>\r\n',	'2017-09-02 06:13:09',	'2017-09-06 09:23:33',	1,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	0);
